INSERT INTO `b_event_message` VALUES (1,'2011-05-26 14:14:56','NEW_USER','s1','Y','#DEFAULT_EMAIL_FROM#','#DEFAULT_EMAIL_FROM#','#SITE_NAME#: Зарегистрировался новый пользователь','Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\n\nНа сайте #SERVER_NAME# успешно зарегистрирован новый пользователь.\n\nДанные пользователя:\nID пользователя: #USER_ID#\n\nИмя: #NAME#\nФамилия: #LAST_NAME#\nE-Mail: #EMAIL#\n\nLogin: #LOGIN#\n\nПисьмо сгенерировано автоматически.','text',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2,'2011-05-26 14:14:56','USER_INFO','s1','Y','#DEFAULT_EMAIL_FROM#','#EMAIL#','#SITE_NAME#: Регистрационная информация','Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\n#NAME# #LAST_NAME#,\n\n#MESSAGE#\n\nВаша регистрационная информация:\n\nID пользователя: #USER_ID#\nСтатус бюджета: #STATUS#\nLogin: #LOGIN#\n\nВы можете изменить пароль, перейдя по следующей ссылке:\nhttp://#SERVER_NAME#/auth/index.php?change_password=yes&lang=ru&USER_CHECKWORD=#CHECKWORD#\n\nСообщение сгенерировано автоматически.','text',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(3,'2011-05-26 14:14:56','USER_PASS_REQUEST','s1','Y','#DEFAULT_EMAIL_FROM#','#EMAIL#','#SITE_NAME#: Запрос на смену пароля','Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\n#NAME# #LAST_NAME#,\n\n#MESSAGE#\n\nДля смены пароля перейдите по следующей ссылке:\nhttp://#SERVER_NAME#/auth/index.php?change_password=yes&lang=ru&USER_CHECKWORD=#CHECKWORD#\n\nВаша регистрационная информация:\n\nID пользователя: #USER_ID#\nСтатус бюджета: #STATUS#\nLogin: #LOGIN#\n\nСообщение сгенерировано автоматически.','text',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(4,'2011-05-26 14:14:56','USER_PASS_CHANGED','s1','Y','#DEFAULT_EMAIL_FROM#','#EMAIL#','#SITE_NAME#: Подтверждение смены пароля','Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\n#NAME# #LAST_NAME#,\n\n#MESSAGE#\n\nВаша регистрационная информация:\n\nID пользователя: #USER_ID#\nСтатус бюджета: #STATUS#\nLogin: #LOGIN#\n\nСообщение сгенерировано автоматически.','text',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(5,'2011-05-26 14:14:56','NEW_USER_CONFIRM','s1','Y','#DEFAULT_EMAIL_FROM#','#EMAIL#','#SITE_NAME#: Подтверждение регистрации нового пользователя','Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\n\nЗдравствуйте,\n\nВы получили это сообщение, так как ваш адрес был использован при регистрации нового пользователя на сервере #SERVER_NAME#.\n\nВаш код для подтверждения регистрации: #CONFIRM_CODE#\n\nДля подтверждения регистрации перейдите по следующей ссылке:\nhttp://#SERVER_NAME#/auth/index.php?confirm_registration=yes&confirm_user_id=#USER_ID#&confirm_code=#CONFIRM_CODE#\n\nВы также можете ввести код для подтверждения регистрации на странице:\nhttp://#SERVER_NAME#/auth/index.php?confirm_registration=yes&confirm_user_id=#USER_ID#\n\nВнимание! Ваш бюджет не будет активным, пока вы не подтвердите свою регистрацию.\n\n---------------------------------------------------------------------\n\nСообщение сгенерировано автоматически.','text',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(6,'2011-05-26 14:14:56','USER_INVITE','s1','Y','#DEFAULT_EMAIL_FROM#','#EMAIL#','#SITE_NAME#: Приглашение на сайт','Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\nЗдравствуйте, #NAME# #LAST_NAME#!\n\nАдминистратором сайта вы добавлены в число зарегистрированных пользователей.\n\nПриглашаем Вас на наш сайт.\n\nВаша регистрационная информация:\n\nID пользователя: #ID#\nLogin: #LOGIN#\n\nРекомендуем вам сменить установленный автоматически пароль.\n\nДля смены пароля перейдите по следующей ссылке:\nhttp://#SERVER_NAME#/auth.php?change_password=yes&USER_LOGIN=#URL_LOGIN#&USER_CHECKWORD=#CHECKWORD#\n','text',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(7,'2011-05-26 14:14:56','FEEDBACK_FORM','s1','Y','#DEFAULT_EMAIL_FROM#','#EMAIL_TO#','#SITE_NAME#: Сообщение из формы обратной связи','Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\n\nВам было отправлено сообщение через форму обратной связи\n\nАвтор: #AUTHOR#\nE-mail автора: #AUTHOR_EMAIL#\n\nТекст сообщения:\n#TEXT#\n\nСообщение сгенерировано автоматически.','text',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(8,'2011-05-26 14:14:58','ADV_BANNER_STATUS_CHANGE','s1','Y','#DEFAULT_EMAIL_FROM#','#EMAIL_TO#','[BID##ID#] #SITE_NAME#: Изменился статус баннера - [#STATUS#]','Статус баннера # #ID# изменился на [#STATUS#].\n\n>=================== Параметры баннера ===============================\n\nБаннер   - [#ID#] #NAME#\nКонтракт - [#CONTRACT_ID#] #CONTRACT_NAME#\nТип      - [#TYPE_SID#] #TYPE_NAME#\nГруппа   - #GROUP_SID#\n\n----------------------------------------------------------------------\n\nАктивность: #INDICATOR#\n\nПериод    - [#DATE_SHOW_FROM# - #DATE_SHOW_TO#]\nПоказан   - #SHOW_COUNT# / #MAX_SHOW_COUNT# [#DATE_LAST_SHOW#]\nКликнули  - #CLICK_COUNT# / #MAX_CLICK_COUNT# [#DATE_LAST_CLICK#]\nФлаг акт. - [#ACTIVE#]\nСтатус    - [#STATUS#]\nКомментарий:\n#STATUS_COMMENTS#\n----------------------------------------------------------------------\n\nИзображение - [#IMAGE_ALT#] #IMAGE_LINK#\nURL         - [#URL_TARGET#] #URL#\n\nКод: [#CODE_TYPE#]\n#CODE#\n\n>=====================================================================\n\nСоздан  - #CREATED_BY# [#DATE_CREATE#]\nИзменен - #MODIFIED_BY# [#DATE_MODIFY#]\n\nДля просмотра параметров баннера воспользуйтесь ссылкой:\nhttp://#SERVER_NAME#/bitrix/admin/adv_banner_edit.php?ID=#ID#&CONTRACT_ID=#CONTRACT_ID#&lang=ru\n\nПисьмо сгенерировано автоматически.\n','text','#BCC#',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(9,'2011-05-26 14:14:58','ADV_CONTRACT_INFO','s1','Y','#DEFAULT_EMAIL_FROM#','#EMAIL_TO#','[CID##ID#] #SITE_NAME#: Параметры рекламного контракта','#MESSAGE#\nКонтракт: [#ID#] #NAME#\n#DESCRIPTION#\n>================== Параметры контракта =