=============================================================================================\nДля добавления в стоп-лист воспользуйтесь нижеследующей ссылкой:\nhttp://#SERVER_NAME##STOPLIST_LINK#\nДля просмотра сессии посетителя воспользуйтесь нижеследующей ссылкой:\nhttp://#SERVER_NAME##SESSION_LINK#\nДля просмотра профайла посетителя воспользуйтесь нижеследующей ссылкой:\nhttp://#SERVER_NAME##VISITOR_LINK#\nДля просмотра статистики хитов поисковика воспользуйтесь нижеследующей ссылкой:\nhttp://#SERVER_NAME##SEARCHER_LINK#\n','html','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(46,'2011-05-26 14:15:41','SUBSCRIBE_CONFIRM','s1','Y','#DEFAULT_EMAIL_FROM#','#EMAIL#','#SITE_NAME#: Подтверждение подписки','Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\n\nЗдравствуйте,\n\nВы получили это сообщение, так как ваш адрес был подписан\nна список рассылки сервера #SERVER_NAME#.\n\nДополнительная информация о подписке:\n\nАдрес подписки (email) ............ #EMAIL#\nДата добавления/редактирования .... #DATE_SUBSCR#\n\nВаш код для подтверждения подписки: #CONFIRM_CODE#\n\nДля подтверждения подписки перейдите по следующей ссылке:\nhttp://#SERVER_NAME##SUBSCR_SECTION#subscr_edit.php?ID=#ID#&CONFIRM_CODE=#CONFIRM_CODE#\n\nВы также можете ввести код для подтверждения подписки на странице:\nhttp://#SERVER_NAME##SUBSCR_SECTION#subscr_edit.php?ID=#ID#\n\nВнимание! Вы не будете получать сообщения рассылки, пока не подтвердите\nсвою подписку.\n\n---------------------------------------------------------------------\nСохраните это письмо, так как оно содержит информацию для авторизации.\nИспользуя код подтверждения подписки, вы cможете изменить параметры\nподписки или отписаться от рассылки.\n\nИзменить параметры:\nhttp://#SERVER_NAME##SUBSCR_SECTION#subscr_edit.php?ID=#ID#&CONFIRM_CODE=#CONFIRM_CODE#\n\nОтписаться:\nhttp://#SERVER_NAME##SUBSCR_SECTION#subscr_edit.php?ID=#ID#&CONFIRM_CODE=#CONFIRM_CODE#&action=unsubscribe\n---------------------------------------------------------------------\n\nСообщение сгенерировано автоматически.\n','text','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(47,'2011-05-26 14:15:42','TICKET_NEW_FOR_AUTHOR','s1','Y','#DEFAULT_EMAIL_FROM#','#OWNER_EMAIL#','[TID##ID#] #SERVER_NAME#: Ваше обращение принято','Ваше обращение принято, ему присвоен номер #ID#.\n\nВы не должны отвечать на это письмо. Это только подтверждение, \nчто служба техподдержки получила ваше обращение и работает с ним.\n\nИнформация о вашем обращении:\n\nТема          - #TITLE# \nОт кого       - #SOURCE##OWNER_SID##OWNER_TEXT#\nКатегория     - #CATEGORY#\nКритичность   - #CRITICALITY#\n\nСоздано           - #CREATED_TEXT##CREATED_MODULE_NAME# [#DATE_CREATE#]\nОтветственный     - #RESPONSIBLE_TEXT#\nУровень поддержки - #SLA#\n\n>======================= СООБЩЕНИЕ ===================================\n\n#FILES_LINKS##MESSAGE_BODY#\n\n>=====================================================================\n\nДля просмотра и редактирования обращения воспользуйтесь ссылкой:\nhttp://#SERVER_NAME##PUBLIC_EDIT_URL#?ID=#ID#\n\nПисьмо сгенерировано автоматически.\n','text','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(48,'2011-05-26 14:15:42','TICKET_NEW_FOR_TECHSUPPORT','s1','Y','#DEFAULT_EMAIL_FROM#','#SUPPORT_EMAIL#','[TID##ID#] #SERVER_NAME#: Новое обращение','Новое обращение # #ID# в службу техподдержки сайта #SERVER_NAME#.\n#SPAM_MARK#\nОт кого: #SOURCE##OWNER_SID##OWNER_TEXT#\n\nТема: #TITLE# \n\n>======================= СООБЩЕНИЕ ===================================\n\n#FILES_LINKS##MESSAGE_BODY#\n\n>=====================================================================\n\nОтветственный     - #RESPONSIBLE_TEXT#\nКатегория         - #CATEGORY#\nКритичность       - #CRITICALITY#\nУровень поддержки - #SLA#\nСоздано           - #CREATED_TEXT##CREATED_MODULE_NAME# [#DATE_CREATE#]\n\nДля просмотра и редактирования обращения воспользуйтесь ссылкой:\nhttp://#SERVER_NAME##ADMIN_EDIT_URL#?ID=#ID#&lang=#LANGUAGE_ID#\n\nПисьмо сгенерировано автоматически. \n','text','#SUPPORT_ADMIN_EMAIL#',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(49,'2011-05-26 14:15:42','TICKET_CHANGE_BY_SUPPORT_FOR_AUTHOR','s1','Y','#DEFAULT_EMAIL_FROM#','#OWNER_EMAIL#','[TID##ID#] #SERVER_NAME#: Изменения в вашем обращении','Изменения в вашем обращении # #ID# на сайте #SERVER_NAME#.\n\n#WHAT_CHANGE#\nТема: #TITLE# \n\nОт кого: #MESSAGE_SOURCE##MESSAGE_AUTHOR_SID##MESSAGE_AUTHOR_TEXT#\n\n>======================= СООБЩЕНИЕ ===================================#FILES_LINKS##MESSAGE_BODY#\n>=====================================================================\n\nАвтор    - #SOURCE##OWNER_SID##OWNER_TEXT#\nСоздано  - #CREATED_TEXT##CREATED_MODULE_NAME# [#DATE_CREATE#]\nИзменено - #MODIFIED_TEXT##MODIFIED_MODULE_NAME# [#TIMESTAMP#]\n\nОтветственный     - #RESPONSIBLE_TEXT#\nКатегория         - #CATEGORY#\nКритичность       - #CRITICALITY#\nСтатус            - #STATUS#\nОценка ответов    - #RATE#\nУровень поддержки - #SLA#\n\nДля просмотра и редактирования обращения воспользуйтесь ссылкой:\nhttp://#SERVER_NAME##PUBLIC_EDIT_URL#?ID=#ID#\n\nМы просим Вас не забыть оценить ответы службы техподдержки после закрытия обращения:\nhttp://#SERVER_NAME##PUBLIC_EDIT_URL#?ID=#ID#\n\nПисьмо сгенерировано автоматически.\n','text','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(50,'2011-05-26 14:15:42','TICKET_CHANGE_BY_AUTHOR_FOR_AUTHOR','s1','Y','#DEFAULT_EMAIL_FROM#','#OWNER_EMAIL#','[TID##ID#] #SERVER_NAME#: Изменения в вашем обращении','Изменения в вашем обращении # #ID# на сайте #SERVER_NAME#.\n\n#WHAT_CHANGE#\nТема: #TITLE# \n\nОт кого: #MESSAGE_SOURCE##MESSAGE_AUTHOR_SID##MESSAGE_AUTHOR_TEXT#\n\n>======================= СООБЩЕНИЕ ===================================#FILES_LINKS##MESSAGE_BODY#\n>=====================================================================\n\nАвтор    - #SOURCE##OWNER_SID##OWNER_TEXT#\nСоздано  - #CREATED_TEXT##CREATED_MODULE_NAME# [#DATE_CREATE#]\nИзменено - #MODIFIED_TEXT##MODIFIED_MODULE_NAME# [#TIMESTAMP#]\n\nОтветственный     - #RESPONSIBLE_TEXT#\nКатегория         - #CATEGORY#\nКритичность       - #CRITICALITY#\nСтатус            - #STATUS#\nОценка ответов    - #RATE#\nУровень поддержки - #SLA#\n\nДля просмотра и редактирования обращения воспользуйтесь ссылкой:\nhttp://#SERVER_NAME##PUBLIC_EDIT_URL#?ID=#ID#\n\nМы просим Вас не забыть оценить ответы службы техподдержки после закрытия обращения:\nhttp://#SERVER_NAME##PUBLIC_EDIT_URL#?ID=#ID#\n\nПисьмо сгенерировано автоматически.\n','text','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(51,'2011-05-26 14:15:42','TICKET_CHANGE_FOR_TECHSUPPORT','s1','Y','#DEFAULT_EMAIL_FROM#','#SUPPORT_EMAIL#','[TID##ID#] #SERVER_NAME#: Изменения в обращении','Изменения в обращении # #ID# к службе техподдержки сайта #SERVER_NAME#.\n#SPAM_MARK#\n#WHAT_CHANGE#\nТема: #TITLE# \n\nОт кого: #MESSAGE_SOURCE##MESSAGE_AUTHOR_SID##MESSAGE_AUTHOR_TEXT#\n\n>#MESSAGE_HEADER##FILES_LINKS##MESSAGE_BODY#\n>#MESSAGE_FOOTER#\n\nАвтор    - #SOURCE##OWNER_SID##OWNER_TEXT#\nСоздано  - #CREATED_TEXT##CREATED_MODULE_NAME# [#DATE_CREATE#]\nИзменено - #MODIFIED_TEXT##MODIFIED_MODULE_NAME# [#TIMESTAMP#]\n\nОтветственный     - #RESPONSIBLE_TEXT#\nКатегория         - #CATEGORY#\nКритичность       - #CRITICALITY#\nСтатус            - #STATUS#\nОценка ответов    - #RATE#\nУровень поддержки - #SLA#\n\n>====================== КОММЕНТАРИЙ ==================================#SUPPORT_COMMENTS#\n>=====================================================================\n\nДля просмотра и редактирования обращения воспользуйтесь ссылкой:\nhttp://#SERVER_NAME##ADMIN_EDIT_URL#?ID=#ID#&lang=#LANGUAGE_ID#\n\nПисьмо сгенерировано автоматически.\n','text','#SUPPORT_ADMIN_EMAIL#',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(52,'2011-05-26 14:15:42','TICKET_OVERDUE_REMINDER','s1','Y','#DEFAULT_EMAIL_FROM#','#SUPPORT_EMAIL#','[TID##ID#] #SERVER_NAME#: Напоминание о необходимости ответа','Напоминание о необходимости ответа в обращении # #ID# к службе техподдержки сайта #SERVER_NAME#.\n\nКогда будет просроч