INSERT INTO `b_iblock_element` VALUES (1,'2011-05-26 18:18:26',1,'2011-05-26 18:18:26',1,1,NULL,'Y','2010-11-25 00:00:00',NULL,500,'Мебельный форум Беларуси',NULL,'С 20 по 23 апреля 2010 года состоится <strong>Мебельный Форум Беларуси</strong> &ndash; важнейшее мероприятии отрасли в текущем году.','html',NULL,'<p>С 20 по 23 апреля 2010 года состоится <strong>Мебельный Форум Беларуси</strong> &ndash; важнейшее мероприятии отрасли в текущем году. В экспозиции принимают участие свыше 160 компаний из <em>Беларуси, Австрии, Латвии, Литвы, России, Польши </em>и<em> Украины</em>. В составе форума состоится пять выставок:&quot;Минский мебельный салон&quot;, &quot;Мебельные технологии&quot;, &quot;ОфисКомфорт&quot;, &quot;Кухня&quot; и &quot;Домотех&quot;. Экспозиция будет строиться по принципу двух тематических секторов:<em> готовой мебели</em> и <em>материалов для ее производства</em>.\r\n \r\n \r\n \r\n  <br />\r\n\r\n \r\n \r\n </p>\r\n\r\n \r\n \r\n \r\n \r\n \r\n \r\n<p>В секторе готовой мебели будут представлены:</p>\r\n\r\n \r\n \r\n \r\n \r\n \r\n \r\n<ul>\r\n \r\n \r\n \r\n  <li>корпусная и мягкая мебель;</li>\r\n\r\n \r\n \r\n \r\n \r\n \r\n \r\n  <li>мебель для детей и молодежи;</li>\r\n\r\n \r\n \r\n \r\n \r\n \r\n \r\n  <li>предметы интерьера;</li>\r\n\r\n \r\n \r\n \r\n \r\n \r\n \r\n  <li>кухонная мебель;</li>\r\n\r\n \r\n \r\n \r\n \r\n \r\n \r\n  <li>мебель для офиса и административных зданий.</li>\r\n\r\n \r\n \r\n </ul>\r\n\r\n \r\n \r\n \r\n \r\n \r\n \r\n<p>В секторе материалов для производства мебели будут демонстрироваться новинки рынка мебельной фурнитуры, материалов, обивочных тканей, элементов и аксессуаров для производства мебели.\r\n \r\n \r\n  <br />\r\n\r\n \r\n \r\n </p>\r\n\r\n \r\n \r\n \r\n \r\n<p>Помимо расширенной экспозиции пяти тематических выставок &quot;Экспофорум&quot; подготовил разнообразную деловую программу Мебельного форума. В рамках выставки состоятся семинары и мастер-классы. И поистине масштабным в этом году обещает стать республиканский конкурс форума &quot;<strong>Народное признание</strong>&quot;. В этом году он выходит за рамки выставки и становится республиканским смотром образцов мебели.\r\n \r\n \r\n  <br />\r\n\r\n \r\n <strong>Мебельный Форум</strong> предоставляет специалистам возможность познакомиться с тенденциями мебельной моды, провести переговоры, получить практические предложения рынка, увидеть перспективы развития и новые конкурентные преимущества. Впервые для участников конкурса будет подготовлен маркетинговый отчет по результатам опроса посетителей выставок <strong>Мебельного Форума</strong>.\r\n \r\n \r\n  <br />\r\n\r\n \r\n </p>\r\n\r\n<p><em>Прием заявок на участие в конкурсе осуществляется до 12 апреля 2010 года.</em></p>\r\n\r\n \r\n \r\n \r\n \r\n<ul>\r\n </ul>\r\n\r\n \r\n \r\n \r\n ','html','МЕБЕЛЬНЫЙ ФОРУМ БЕЛАРУСИ\r\nС 20 ПО 23 АПРЕЛЯ 2010 ГОДА СОСТОИТСЯ МЕБЕЛЬНЫЙ ФОРУМ БЕЛАРУСИ &NDASH; \r\nВАЖНЕЙШЕЕ МЕРОПРИЯТИИ ОТРАСЛИ В ТЕКУЩЕМ ГОДУ.\r\nС 20 ПО 23 АПРЕЛЯ 2010 ГОДА СОСТОИТСЯ МЕБЕЛЬНЫЙ ФОРУМ БЕЛАРУСИ &NDASH; \r\nВАЖНЕЙШЕЕ МЕРОПРИЯТИИ ОТРАСЛИ В ТЕКУЩЕМ ГОДУ. В ЭКСПОЗИЦИИ ПРИНИМАЮТ УЧАСТИЕ \r\nСВЫШЕ 160 КОМПАНИЙ ИЗ БЕЛАРУСИ, АВСТРИИ, ЛАТВИИ, ЛИТВЫ, РОССИИ, ПОЛЬШИ И \r\nУКРАИНЫ. В СОСТАВЕ ФОРУМА СОСТОИТСЯ ПЯТЬ ВЫСТАВОК:\"МИНСКИЙ МЕБЕЛЬНЫЙ САЛОН\", \r\n\"МЕБЕЛЬНЫЕ ТЕХНОЛОГИИ\", \"ОФИСКОМФОРТ\", \"КУХНЯ\" И \"ДОМОТЕХ\". ЭКСПОЗИЦИЯ БУДЕТ \r\nСТРОИТЬСЯ ПО ПРИНЦИПУ ДВУХ ТЕМАТИЧЕСКИХ СЕКТОРОВ: ГОТОВОЙ МЕБЕЛИ И МАТЕРИАЛОВ \r\nДЛЯ ЕЕ ПРОИЗВОДСТВА. \r\n \r\n\r\nВ СЕКТОРЕ ГОТОВОЙ МЕБЕЛИ БУДУТ ПРЕДСТАВЛЕНЫ: \r\n\r\n- КОРПУСНАЯ И МЯГКАЯ МЕБЕЛЬ; \r\n- МЕБЕЛЬ ДЛЯ ДЕТЕЙ И МОЛОДЕЖИ; \r\n- ПРЕДМЕТЫ ИНТЕРЬЕРА; \r\n- КУХОННАЯ МЕБЕЛЬ; \r\n- МЕБЕЛЬ ДЛЯ ОФИСА И АДМИНИСТРАТИВНЫХ ЗДАНИЙ. \r\n\r\nВ СЕКТОРЕ МАТЕРИАЛОВ ДЛЯ ПРОИЗВОДСТВА МЕБЕЛИ БУДУТ ДЕМОНСТРИРОВАТЬСЯ НОВИНКИ \r\nРЫНКА МЕБЕЛЬНОЙ ФУРНИТУРЫ, МАТЕРИАЛОВ, ОБИВОЧНЫХ ТКАНЕЙ, ЭЛЕМЕНТОВ И АКСЕССУАРОВ \r\nДЛЯ ПРОИЗВОДСТВА МЕБЕЛИ. \r\n \r\n\r\nПОМИМО РАСШИРЕННОЙ ЭКСПОЗИЦИИ ПЯТИ ТЕМАТИЧЕСКИХ ВЫСТАВОК \"ЭКСПОФОРУМ\" ПОДГОТОВИЛ \r\nРАЗНООБРАЗНУЮ ДЕЛОВУЮ ПРОГРАММУ МЕБЕЛЬНОГО ФОРУМА. В РАМКАХ ВЫСТАВКИ СОСТОЯТСЯ \r\nСЕМИНАРЫ И МАСТЕР-КЛАССЫ. И ПОИСТИНЕ МАСШТАБНЫМ В ЭТОМ ГОДУ ОБЕЩАЕТ СТАТЬ \r\nРЕСПУБЛИКАНСКИЙ КОНКУРС ФОРУМА \"НАРОДНОЕ ПРИЗНАНИЕ\". В ЭТОМ ГОДУ ОН ВЫХОДИТ \r\nЗА РАМКИ ВЫСТАВКИ И СТАНОВИТСЯ РЕСПУБЛИКАНСКИМ СМОТРОМ ОБРАЗЦОВ МЕБЕЛИ. \r\nМЕБЕЛЬНЫЙ ФОРУМ ПРЕДОСТАВЛЯЕТ СПЕЦИАЛИСТАМ ВОЗМОЖНОСТЬ ПОЗНАКОМИТЬСЯ С \r\nТЕНДЕНЦИЯМИ МЕБЕЛЬНОЙ МОДЫ, ПРОВЕСТИ ПЕРЕГОВОРЫ, ПОЛУЧИТЬ ПРАКТИЧЕСКИЕ ПРЕДЛОЖЕНИЯ \r\nРЫНКА, УВИДЕТЬ ПЕРСПЕКТИВЫ РАЗВИТИЯ И НОВЫЕ КОНКУРЕНТНЫЕ ПРЕИМУЩЕСТВА. ВПЕРВЫЕ \r\nДЛЯ УЧАСТНИКОВ КОНКУРСА БУДЕТ ПОДГОТОВЛЕН МАРКЕТИНГОВЫЙ ОТЧЕТ ПО РЕЗУЛЬТАТАМ \r\nОПРОСА ПОСЕТИТЕЛЕЙ ВЫСТАВОК МЕБЕЛЬНОГО ФОРУМА. \r\n \r\n\r\nПРИЕМ ЗАЯВОК НА УЧАСТИЕ В КОНКУРСЕ ОСУЩЕСТВЛЯЕТСЯ ДО 12 АПРЕЛЯ 2010 ГОДА.',1,NULL,NULL,NULL,NULL,NULL,'N','1','furniture_forum_belarus',NULL,'-2019871272',NULL,2,'2011-05-27 10:05:46'),(2,'2011-05-26 18:18:26',1,'2011-05-26 18:18:26',1,1,NULL,'Y','2010-11-26 00:00:00',NULL,500,'Международная мебельная выставка SALON DEL MOBILE',NULL,'В 2010 году выставка Salon del Mobile обещает быть еще более расширенной и интересной. ','html',NULL,'В 2010 году выставка Salon del Mobile обещает быть еще более расширенной и интересной. На выставке Salon del Mobile будут представлены все типы мебели для офиса и дома от спален и гостиных до VIP-кабинетов, включая оборудование для сада и детской мебели. Заявки на участие подали более чем 1 500 компаний со всего мира. Предполагается, что за время проведения выставки ее посетят более 300 000 тысяч человек. Экспозиция выставки разместится на общей площади 149 871 кв.м. В 2010 году эта поистине грандиозная выставка будет проводиться уже в 10-й раз.','text','МЕЖДУНАРОДНАЯ МЕБЕЛЬНАЯ ВЫСТАВКА SALON DEL MOBILE\r\nВ 2010 ГОДУ ВЫСТАВКА SALON DEL MOBILE ОБЕЩАЕТ БЫТЬ ЕЩЕ БОЛЕЕ РАСШИРЕННОЙ \r\nИ ИНТЕРЕСНОЙ.\r\nВ 2010 ГОДУ ВЫСТАВКА SALON DEL MOBILE ОБЕЩАЕТ БЫТЬ ЕЩЕ БОЛЕЕ РАСШИРЕННОЙ И ИНТЕРЕСНОЙ. НА ВЫСТАВКЕ SALON DEL MOBILE БУДУТ ПРЕДСТАВЛЕНЫ ВСЕ ТИПЫ МЕБЕЛИ ДЛЯ ОФИСА И ДОМА ОТ СПАЛЕН И ГОСТИНЫХ ДО VIP-КАБИНЕТОВ, ВКЛЮЧАЯ ОБОРУДОВАНИЕ ДЛЯ САДА И ДЕТСКОЙ МЕБЕЛИ. ЗАЯВКИ НА УЧАСТИЕ ПОДАЛИ БОЛЕЕ ЧЕМ 1 500 КОМПАНИЙ СО ВСЕГО МИРА. ПРЕДПОЛАГАЕТСЯ, ЧТО ЗА ВРЕМЯ ПРОВЕДЕНИЯ ВЫСТАВКИ ЕЕ ПОСЕТЯТ БОЛЕЕ 300 000 ТЫСЯЧ ЧЕЛОВЕК. ЭКСПОЗИЦИЯ ВЫСТАВКИ РАЗМЕСТИТСЯ НА ОБЩЕЙ ПЛОЩАДИ 149 871 КВ.М. В 2010 ГОДУ ЭТА ПОИСТИНЕ ГРАНДИОЗНАЯ ВЫСТАВКА БУДЕТ ПРОВОДИТЬСЯ УЖЕ В 10-Й РАЗ.',1,NULL,NULL,NULL,NULL,NULL,'N','8','salon_del_mobile',NULL,'-1026899721',NULL,2,'2011-05-27 10:04:02'),(3,'2011-05-26 18:18:26',1,'2011-05-26 18:18:26',1,1,NULL,'Y','2010-11-27 00:00:00',NULL,500,'Получено прочное водостойкое соединение',NULL,'Получено новое прочное водостойкое клеевое соединение.Изобретение относится к области получения и применения клеящих составов, используемых в деревообрабатывающей, мебельной и строительной промышленности. Данная клеевая композиция предназначена только для горячего прессования и имеет в своем составе многокомпонентный отвердитель. ','html',NULL,'<b>Авторы изобретения</b>: Разиньков Егор Михайлович  и Мещерякова Анна Анатольевна </br>\r\n              Патент Российской Федерации RU2277566</br>\r\n              <h3>Описание изобретения</h3>\r\n              <p>Изобретение относится к области получения и применения клеящих составов, используемых в деревообрабатывающей, мебельной и строительной промышленности.\r\n              Данная клеевая композиция предназначена только для горячего прессования и имеет в своем составе многокомпонентный отвердитель. Прототипом клеевой композиции является клей, состоящий из карбамидоформальдегидной смолы, сополимера акрилонитрила с N-винилкапролактамом и отвердитель. В качестве отвердителя применяют хлористый аммоний либо акриловую кислоту. </p>\r\n\r\n              <p>Изобретение решает задачу по получению прочного и водостойкого клеевого соединения.\r\n              Это достигается тем, что клеевая композиция, включающая синтетическую смолу и отвердитель, согласно изобретению, дополнительно содержит модификатор, причем в качестве синтетической смолы клеевая композиция включает карбамидомеламиноформальдегидную смолу с отвердителем 2542, в качестве модификатора - карбамидоформальдегидную смолу, а в качестве отвердителя - 10%-ный раствор щавелевой кислоты при следующем соотношении компонентов, мас.ч.:\r\n              </p>\r\n              <table cellspacing=\"10\">\r\n              <tr>\r\n              <td>Карбамидомеламиноформальдегидная смола</td><td>64,5-79,2</td>\r\n              </tr>	\r\n              <tr>\r\n              <td>10%-ный Раствор щавелевой кислоты</td><td>4,4-20,5</td>\r\n\r\n              </tr>\r\n              <tr>\r\n              <td> Отвердитель для карбамидомеламиноформальдегидной </td><td>0,6-2,0</td>\r\n              </tr>\r\n              <tr>\r\n              <td> смолы 2542</td><td>13,0-15,8</td>\r\n\r\n              </tr>	\r\n              </table>\r\n','html','ПОЛУЧЕНО ПРОЧНОЕ ВОДОСТОЙКОЕ СОЕДИНЕНИЕ\r\nПОЛУЧЕНО НОВОЕ ПРОЧНОЕ ВОДОСТОЙКОЕ КЛЕЕВОЕ СОЕДИНЕНИЕ.ИЗОБРЕТЕНИЕ ОТНОСИТСЯ \r\nК ОБЛАСТИ ПОЛУЧЕНИЯ И ПРИМЕНЕНИЯ КЛЕЯЩИХ СОСТАВОВ, ИСПОЛЬЗУЕМЫХ В ДЕРЕВООБРАБАТЫВАЮЩЕЙ, \r\nМЕБЕЛЬНОЙ И СТРОИТЕЛЬНОЙ ПРОМЫШЛЕННОСТИ. ДАННАЯ КЛЕЕВАЯ КОМПОЗИЦИЯ ПРЕДНАЗНАЧЕНА \r\nТОЛЬКО ДЛЯ ГОРЯЧЕГО ПРЕССОВАНИЯ И ИМЕЕТ В СВОЕМ СОСТАВЕ МНОГОКОМПОНЕНТНЫЙ \r\nОТВЕРДИТЕЛЬ.\r\nАВТОРЫ ИЗОБРЕТЕНИЯ: РАЗИНЬКОВ ЕГОР МИХАЙЛОВИЧ И МЕЩЕРЯКОВА АННА АНАТОЛЬЕВНА \r\nПАТЕНТ РОССИЙСКОЙ ФЕДЕРАЦИИ RU2277566 ОПИСАНИЕ ИЗОБРЕТЕНИЯ \r\n\r\nИЗОБРЕТЕНИЕ ОТНОСИТСЯ К ОБЛАСТИ ПОЛУЧЕНИЯ И ПРИМЕНЕНИЯ КЛЕЯЩИХ СОСТАВОВ, \r\nИСПОЛЬЗУЕМЫХ В ДЕРЕВООБРАБАТЫВАЮЩЕЙ, МЕБЕЛЬНОЙ И СТРОИТЕЛЬНОЙ ПРОМЫШЛЕННОСТИ. \r\nДАННАЯ КЛЕЕВАЯ КОМПОЗИЦИЯ ПРЕДНАЗНАЧЕНА ТОЛЬКО ДЛЯ ГОРЯЧЕГО ПРЕССОВАНИЯ \r\nИ ИМЕЕТ В СВОЕМ СОСТАВЕ МНОГОКОМПОНЕНТНЫЙ ОТВЕРДИТЕЛЬ. ПРОТОТИПОМ КЛЕЕВОЙ \r\nКОМПОЗИЦИИ ЯВЛЯЕТСЯ КЛЕЙ, СОСТОЯЩИЙ ИЗ КАРБАМИДОФОРМАЛЬДЕГИДНОЙ СМОЛЫ, СОПОЛИМЕРА \r\nАКРИЛОНИТРИЛА С N-ВИНИЛКАПРОЛАКТАМОМ И ОТВЕРДИТЕЛЬ. В КАЧЕСТВЕ ОТВЕРДИТЕЛЯ \r\nПРИМЕНЯЮТ ХЛОРИСТЫЙ АММОНИЙ ЛИБО АКРИЛОВУЮ КИСЛОТУ. \r\n\r\nИЗОБРЕТЕНИЕ РЕШАЕТ ЗАДАЧУ ПО ПОЛУЧЕНИЮ ПРОЧНОГО И ВОДОСТОЙКОГО КЛЕЕВОГО \r\nСОЕДИНЕНИЯ. ЭТО ДОСТИГАЕТСЯ ТЕМ, ЧТО КЛЕЕВАЯ КОМПОЗИЦИЯ, ВКЛЮЧАЮЩАЯ СИНТЕТИЧЕСКУЮ \r\nСМОЛУ И ОТВЕРДИТЕЛЬ, СОГЛАСНО ИЗОБРЕТЕНИЮ, ДОПОЛНИТЕЛЬНО СОДЕРЖИТ МОДИФИКАТОР, \r\nПРИЧЕМ В КАЧЕСТВЕ СИНТЕТИЧЕСКОЙ СМОЛЫ КЛЕЕВАЯ КОМПОЗИЦИЯ ВКЛЮЧАЕТ КАРБАМИДОМЕЛАМИНОФОРМАЛЬДЕГИДНУЮ \r\nСМОЛУ С ОТВЕРДИТЕЛЕМ 2542, В КАЧЕСТВЕ МОДИФИКАТОРА - КАРБАМИДОФОРМАЛЬДЕГИДНУЮ \r\nСМОЛУ, А В КАЧЕСТВЕ ОТВЕРДИТЕЛЯ - 10%-НЫЙ РАСТВОР ЩАВЕЛЕВОЙ КИСЛОТЫ ПРИ \r\nСЛЕДУЮЩЕМ СООТНОШЕНИИ КОМПОНЕНТОВ, МАС.Ч.: \r\n КАРБАМИДОМЕЛАМИНОФОРМАЛЬДЕГИДНАЯ СМОЛА    64,5-79,2     \r\n 10%-НЫЙ РАСТВОР ЩАВЕЛЕВОЙ КИСЛОТЫ    4,4-20,5     \r\n ОТВЕРДИТЕЛЬ ДЛЯ КАРБАМИДОМЕЛАМИНОФОРМАЛЬДЕГИДНОЙ     0,6-2,0     \r\n СМОЛЫ 2542    13,0-15,8',1,NULL,NULL,NULL,NULL,NULL,'N','9','waterproof_connection',NULL,'1366329612',NULL,2,'2011-05-27 10:04:54'),(4,'2011-05-26 18:18:27',1,'2011-05-26 18:18:27',1,2,1,'Y',NULL,NULL,600,'Для чего нужна кнопка \"Повторить заказ\" в разделе \"Мои заказы\"?',NULL,'','html',NULL,'<p>С помощью этой кнопки клиент может поместить в корзину все товары из любого ранее оформленного заказа.</p>\r\n \r\n ','html','ДЛЯ ЧЕГО НУЖНА КНОПКА \"ПОВТОРИТЬ ЗАКАЗ\" В РАЗДЕЛЕ \"МОИ ЗАКАЗЫ\"?\r\n\r\nС ПОМОЩЬЮ ЭТОЙ КНОПКИ КЛИЕНТ МОЖЕТ ПОМЕСТИТЬ В КОРЗИНУ ВСЕ ТОВАРЫ ИЗ ЛЮБОГО \r\nРАНЕЕ ОФОРМЛЕННОГО ЗАКАЗА.',1,NULL,NULL,NULL,NULL,NULL,'Y','32',NULL,NULL,'401104101',NULL,NULL,NULL),(5,'2011-05-26 18:18:27',1,'2011-05-26 18:18:27',1,2,1,'Y',NULL,NULL,700,'Как объединить два или несколько заказов в один?',NULL,'','html',NULL,'<p>Объединение нескольких заказов в один, к сожалению, технически невозможно.</p>\r\n<p>В крайнем случае, можно аннулировать оформленные заказы и оформить новый с общим составом. </p>','html','КАК ОБЪЕДИНИТЬ ДВА ИЛИ НЕСКОЛЬКО ЗАКАЗОВ В ОДИН?\r\n\r\nОБЪЕДИНЕНИЕ НЕСКОЛЬКИХ ЗАКАЗОВ В ОДИН, К СОЖАЛЕНИЮ, ТЕХНИЧЕСКИ НЕВОЗМОЖНО. \r\n\r\nВ КРАЙНЕМ СЛУЧАЕ, МОЖНО АННУЛИРОВАТЬ ОФОРМЛЕННЫЕ ЗАКАЗЫ И ОФОРМИТЬ НОВЫЙ \r\nС ОБЩИМ СОСТАВОМ.',1,NULL,NULL,NULL,NULL,NULL,'Y','33',NULL,NULL,'1731296040',NULL,NULL,NULL),(6,'2011-05-26 18:18:27',1,'2011-05-26 18:18:27',1,2,1,'Y',NULL,NULL,800,'Можно ли изменить адрес доставки оформленного заказа?',NULL,'','html',NULL,'<p>В оформленном заказе изменение адреса невозможно. </p>\r\n \r\n<p>В крайнем случае, можно в личном кабинете выбрать заказ, для которого хотите изменить адрес, нажать ссылку <b>Повторить заказ</b> и указать другой адрес доставки, а старый заказ отменить.</p>\r\n','html','МОЖНО ЛИ ИЗМЕНИТЬ АДРЕС ДОСТАВКИ ОФОРМЛЕННОГО ЗАКАЗА?\r\n\r\nВ ОФОРМЛЕННОМ ЗАКАЗЕ ИЗМЕНЕНИЕ АДРЕСА НЕВОЗМОЖНО. \r\n\r\nВ КРАЙНЕМ СЛУЧАЕ, МОЖНО В ЛИЧНОМ КАБИНЕТЕ ВЫБРАТЬ ЗАКАЗ, ДЛЯ КОТОРОГО ХОТИТЕ \r\nИЗМЕНИТЬ АДРЕС, НАЖАТЬ ССЫЛКУ ПОВТОРИТЬ ЗАКАЗ И УКАЗАТЬ ДРУГОЙ АДРЕС ДОСТАВКИ, \r\nА СТАРЫЙ ЗАКАЗ ОТМЕНИТЬ.',1,NULL,NULL,NULL,NULL,NULL,'Y','34',NULL,NULL,'1035252422',NULL,NULL,NULL),(7,'2011-05-26 18:18:27',1,'2011-05-26 18:18:27',1,2,1,'Y',NULL,NULL,900,'Как аннулировать заказ или отдельный товар из заказа?',NULL,'','html',NULL,'<p>Чтобы аннулировать заказ или товар из заказа:</p>\r\n \r\n<ul> 	\r\n  <li>Зайдите в раздел <b>Мои заказы</b>;</li>\r\n 	\r\n  <li>Найдите нужный заказ;</li>\r\n 	\r\n  <li>Нажмите на ссылку <b>Отменить заказ</b>.</li>\r\n </ul>\r\n \r\n<p><b>Примечание</b>: отменить заказ можно только до того, как он оплачен.</p>','html','КАК АННУЛИРОВАТЬ ЗАКАЗ ИЛИ ОТДЕЛЬНЫЙ ТОВАР ИЗ ЗАКАЗА?\r\n\r\nЧТОБЫ АННУЛИРОВАТЬ ЗАКАЗ ИЛИ ТОВАР ИЗ ЗАКАЗА: \r\n\r\n- ЗАЙДИТЕ В РАЗДЕЛ МОИ ЗАКАЗЫ; \r\n- НАЙДИТЕ НУЖНЫЙ ЗАКАЗ; \r\n- НАЖМИТЕ НА ССЫЛКУ ОТМЕНИТЬ ЗАКАЗ. \r\n\r\nПРИМЕЧАНИЕ: ОТМЕНИТЬ ЗАКАЗ МОЖНО ТОЛЬКО ДО ТОГО, КАК ОН ОПЛАЧЕН.',1,NULL,NULL,NULL,NULL,NULL,'Y','35',NULL,NULL,'1954609333',NULL,NULL,NULL),(8,'2011-05-26 18:18:27',1,'2011-05-26 18:18:27',1,2,1,'Y',NULL,NULL,1000,'Как узнать о состоянии заказа?',NULL,'','html',NULL,'<p>Покупатель может отследить состояние заказа непосредственно на сайте интернет-магазина в Персональном кабинете. Кроме этого он получает уведомления по электронной почте при оформлении заказа, его оплате и передаче заказа в службу доставки.</p>\r\n \r\n<p>В случае возникновения вопросов клиент всегда может обратиться в службу по работе с клиентами по телефону и получить полную информацию о состоянии заказа.</p>\r\n','html','КАК УЗНАТЬ О СОСТОЯНИИ ЗАКАЗА?\r\n\r\nПОКУПАТЕЛЬ МОЖЕТ ОТСЛЕДИТЬ СОСТОЯНИЕ ЗАКАЗА НЕПОСРЕДСТВЕННО НА САЙТЕ ИНТЕРНЕТ-МАГАЗИНА \r\nВ ПЕРСОНАЛЬНОМ КАБИНЕТЕ. КРОМЕ ЭТОГО ОН ПОЛУЧАЕТ УВЕДОМЛЕНИЯ ПО ЭЛЕКТРОННОЙ \r\nПОЧТЕ ПРИ ОФОРМЛЕНИИ ЗАКАЗА, ЕГО ОПЛАТЕ И ПЕРЕДАЧЕ ЗАКАЗА В СЛУЖБУ ДОСТАВКИ. \r\n\r\nВ СЛУЧАЕ ВОЗНИКНОВЕНИЯ ВОПРОСОВ КЛИЕНТ ВСЕГДА МОЖЕТ ОБРАТИТЬСЯ В СЛУЖБУ \r\nПО РАБОТЕ С КЛИЕНТАМИ ПО ТЕЛЕФОНУ И ПОЛУЧИТЬ ПОЛНУЮ ИНФОРМАЦИЮ О СОСТОЯНИИ \r\nЗАКАЗА.',1,NULL,NULL,NULL,NULL,NULL,'Y','36',NULL,NULL,'-300134239',NULL,NULL,NULL),(9,'2011-05-26 18:18:27',1,'2011-05-26 18:18:27',1,2,1,'Y',NULL,NULL,1100,'Как возвратить товар или предъявить претензию?',NULL,'','html',NULL,'<p>Клиент вправе отказаться от заказанного товара надлежащего качества в любое время до его получения, а после получения - в течение 7 дней, не считая дня покупки. Возврат товара надлежащего качества возможен в случае, если сохранены его товарный вид, потребительские свойства, а также документ, подтверждающий факт и условия покупки указанного товара.</p>\r\n \r\n<p>Если покупатель отказывается от товара, то интернет-магазин возвращает ему стоимость возвращаемого товара, за исключением расходов продавца на доставку товара от клиента до интернет-магазина. </p>\r\n \r\n<p>Клиент может возвратить товар ненадлежащего качества изготовителю или продавцу и потребовать возврата уплаченной денежной суммы в течение гарантийного срока или срока годности. Клиент также вправе потребовать замены товара ненадлежащего качества либо устранения обнаруженных недостатков.</p>\r\n \r\n<p>Возврат средств в обоих случаях производится не позднее чем через 10 дней с даты получения продавцом письменного заявления клиента о возврате товара.</p>\r\n','html','КАК ВОЗВРАТИТЬ ТОВАР ИЛИ ПРЕДЪЯВИТЬ ПРЕТЕНЗИЮ?\r\n\r\nКЛИЕНТ ВПРАВЕ ОТКАЗАТЬСЯ ОТ ЗАКАЗАННОГО ТОВАРА НАДЛЕЖАЩЕГО КАЧЕСТВА В ЛЮБОЕ \r\nВРЕМЯ ДО ЕГО ПОЛУЧЕНИЯ, А ПОСЛЕ ПОЛУЧЕНИЯ - В ТЕЧЕНИЕ 7 ДНЕЙ, НЕ СЧИТАЯ \r\nДНЯ ПОКУПКИ. ВОЗВРАТ ТОВАРА НАДЛЕЖАЩЕГО КАЧЕСТВА ВОЗМОЖЕН В СЛУЧАЕ, ЕСЛИ \r\nСОХРАНЕНЫ ЕГО ТОВАРНЫЙ ВИД, ПОТРЕБИТЕЛЬСКИЕ СВОЙСТВА, А ТАКЖЕ ДОКУМЕНТ, \r\nПОДТВЕРЖДАЮЩИЙ ФАКТ И УСЛОВИЯ ПОКУПКИ УКАЗАННОГО ТОВАРА. \r\n\r\nЕСЛИ ПОКУПАТЕЛЬ ОТКАЗЫВАЕТСЯ ОТ ТОВАРА, ТО ИНТЕРНЕТ-МАГАЗИН ВОЗВРАЩАЕТ \r\nЕМУ СТОИМОСТЬ ВОЗВРАЩАЕМОГО ТОВАРА, ЗА ИСКЛЮЧЕНИЕМ РАСХОДОВ ПРОДАВЦА НА \r\nДОСТАВКУ ТОВАРА ОТ КЛИЕНТА ДО ИНТЕРНЕТ-МАГАЗИНА. \r\n\r\nКЛИЕНТ МОЖЕТ ВОЗВРАТИТЬ ТОВАР НЕНАДЛЕЖАЩЕГО КАЧЕСТВА ИЗГОТОВИТЕЛЮ ИЛИ ПРОДАВЦУ \r\nИ ПОТРЕБОВАТЬ ВОЗВРАТА УПЛАЧЕННОЙ ДЕНЕЖНОЙ СУММЫ В ТЕЧЕНИЕ ГАРАНТИЙНОГО \r\nСРОКА ИЛИ СРОКА ГОДНОСТИ. КЛИЕНТ ТАКЖЕ ВПРАВЕ ПОТРЕБОВАТЬ ЗАМЕНЫ ТОВАРА \r\nНЕНАДЛЕЖАЩЕГО КАЧЕСТВА ЛИБО УСТРАНЕНИЯ ОБНАРУЖЕННЫХ НЕДОСТАТКОВ. \r\n\r\nВОЗВРАТ СРЕДСТВ В ОБОИХ СЛУЧАЯХ ПРОИЗВОДИТСЯ НЕ ПОЗДНЕЕ ЧЕМ ЧЕРЕЗ 10 ДНЕЙ \r\nС ДАТЫ ПОЛУЧЕНИЯ ПРОДАВЦОМ ПИСЬМЕННОГО ЗАЯВЛЕНИЯ КЛИЕНТА О ВОЗВРАТЕ ТОВАРА.',1,NULL,NULL,NULL,NULL,NULL,'Y','37',NULL,NULL,'1130725760',NULL,NULL,NULL),(10,'2011-05-26 18:18:27',1,'2011-05-26 18:18:27',1,2,1,'Y',NULL,NULL,1200,'У меня есть купон на скидку. Как мне им воспользоваться?',NULL,'','html',NULL,'<p>Купон скидок позволяет получить персональную скидку на товар. Для этого при оформлении заказа в разделе <b>Моя корзина</b> укажите код купона скидки в специальном поле. </p>\r\n','html','У МЕНЯ ЕСТЬ КУПОН НА СКИДКУ. КАК МНЕ ИМ ВОСПОЛЬЗОВАТЬСЯ?\r\n\r\nКУПОН СКИДОК ПОЗВОЛЯЕТ ПОЛУЧИТЬ ПЕРСОНАЛЬНУЮ СКИДКУ НА ТОВАР. ДЛЯ ЭТОГО \r\nПРИ ОФОРМЛЕНИИ ЗАКАЗА В РАЗДЕЛЕ МОЯ КОРЗИНА УКАЖИТЕ КОД КУПОНА СКИДКИ В \r\nСПЕЦИАЛЬНОМ ПОЛЕ.',1,NULL,NULL,NULL,NULL,NULL,'Y','38',NULL,NULL,'-1211221484',NULL,NULL,NULL),(4495,'2012-08-08 08:05:02',1,'2011-07-19 12:36:38',1,11,128,'Y',NULL,NULL,500,'Экран на Мельникайте 117',NULL,'','text',NULL,'','text','ЭКРАН НА МЕЛЬНИКАЙТЕ 117\r\n\r\n',1,NULL,NULL,NULL,NULL,NULL,'Y','UT000000214','UT000000214','','6adc5ca63d76d711ec901b35571a8cbd',NULL,NULL,NULL),(4496,'2012-08-08 08:05:02',1,'2011-07-19 12:36:38',1,11,128,'Y',NULL,NULL,500,'Экран на 50 лет октября',NULL,'','text',NULL,'','text','ЭКРАН НА 50 ЛЕТ ОКТЯБРЯ\r\n\r\n',1,NULL,NULL,NULL,NULL,NULL,'Y','UT000000452','UT000000452','','6adc5ca63d76d711ec901b35571a8cbd',NULL,NULL,NULL),(4490,'2011-07-12 22:51:17',1,'2011-07-12 22:51:17',1,10,NULL,'Y',NULL,NULL,500,'Дизайн-Проект',NULL,'','text',NULL,'','text','ДИЗАЙН-ПРОЕКТ\r\n\r\n',1,NULL,NULL,NULL,NULL,NULL,'N','4490',NULL,'',NULL,NULL,NULL,NULL),(4487,'2011-07-05 22:47:24',1,'2011-07-05 22:47:24',1,9,NULL,'Y',NULL,NULL,500,'Широкоформатная печать',NULL,'','text',NULL,'','text','ШИРОКОФОРМАТНАЯ ПЕЧАТЬ\r\n\r\n',1,4486,NULL,NULL,NULL,'','N','4486','4486','',NULL,NULL,NULL,NULL),(4486,'2011-07-05 22:47:24',1,'2011-07-05 22:47:24',1,9,NULL,'Y',NULL,NULL,500,'Широкоформатная печать',NULL,'','text',NULL,'','text','ШИРОКОФОРМАТНАЯ ПЕЧАТЬ\r\n\r\n',1,NULL,'',1,'2011-07-05 23:38:55','','N','4486',NULL,'',NULL,NULL,NULL,NULL),(4451,'2012-08-08 08:01:20',1,'2011-06-10 22:31:44',1,6,107,'N',NULL,NULL,500,'Призматрон 3*6 ул.50 лет Октября, 70, (Областная стоматология), сторона А2',1059,NULL,'text',1060,NULL,'text','ПРИЗМАТРОН 3*6 УЛ.50 ЛЕТ ОКТЯБРЯ, 70, (ОБЛАСТНАЯ СТОМАТОЛОГИЯ), СТОРОНА А2\r\n\r\n',1,NULL,NULL,NULL,NULL,NULL,'Y','UT000000771','UT000000771',NULL,'c747599cb8ca781635edd9b3d4fdda6b',NULL,1,'2011-06-20 23:07:42'),(4452,'2012-08-08 08:01:20',1,'2011-06-10 22:31:44',1,6,107,'N',NULL,NULL,500,'Призматрон 3*6 ул.50 лет Октября, 70, (Областная стоматология), сторона А2',1061,NULL,'text',1062,NULL,'text','ПРИЗМАТРОН 3*6 УЛ.50 ЛЕТ ОКТЯБРЯ, 70, (ОБЛАСТНАЯ СТОМАТОЛОГИЯ), СТОРОНА А2\r\n\r\n',1,NULL,NULL,NULL,NULL,NULL,'Y','UT000000772','UT000000772',NULL,'c747599cb8ca781635edd9b3d4fdda6b',NULL,1,'2011-06-20 23:07:54'),(4453,'2012-08-08 08:01:18',1,'2011-06-10 22:31:44',1,6,107,'Y',NULL,NULL,500,'Призматрон 3*6 ул.Профсоюзная, 2, (Але