INSERT INTO `b_search_content` VALUES (1,'2011-05-26 18:18:23','main','s1|/about/contacts/index.php','s1',0,'/about/contacts/index.php','Задайте вопрос','Уважаемые покупатели!\rПрежде чем задать свой вопрос, обратите внимание на раздел \rПомощь покупателю\r. Возможно, там уже есть исчерпывающая информация по решению вашей проблемы.','','ЗАДАЙТЕ ВОПРОС\r\nУВАЖАЕМЫЕ ПОКУПАТЕЛИ!\rПРЕЖДЕ ЧЕМ ЗАДАТЬ СВОЙ ВОПРОС, ОБРАТИТЕ ВНИМАНИЕ НА РАЗДЕЛ \rПОМОЩЬ ПОКУПАТЕЛЮ\r. ВОЗМОЖНО, ТАМ УЖЕ ЕСТЬ ИСЧЕРПЫВАЮЩАЯ ИНФОРМАЦИЯ ПО РЕШЕНИЮ ВАШЕЙ ПРОБЛЕМЫ.\r\n','','','99430ae9c704754a21fb9fdae6b396ff',NULL,NULL),(2,'2011-05-26 18:18:23','main','s1|/about/delivery/index.php','s1',0,'/about/delivery/index.php','Доставка','Интернет-магазин выполняет доставку любого товара своей собственной Службой доставки.\rСтоимость доставки курьером\rСтоимость доставки товара из нашего магазина - 500 руб, при условии выбора при заказе товара в качестве способа доставки нашим курьером.\rВремя доставки\rВремя доставки согласовывается с менеджером Службы доставки, который обязательно свяжется с Вами сразу после того, как Вы разместите свой заказ. \rВнимание!\rНеправильно указанный номер телефона, неточный или неполный адрес могут привести к дополнительной задержке! Пожалуйста, внимательно проверяйте Ваши персональные данные при регистрации и оформлении заказа.Конфиденциальность ваших регистрационных данных гарантируется.\rДоставка выполняется ежедневно с 10:00 до 20:00 часов, в субботу с 10:00 до 14:00, в воскресенье доставки нет. Товары, заказанные Вами в субботу и воскресенье, доставляются в понедельник. Время осуществления доставки зависит от времени размещения заказа и наличия товара на складе:\rесли заказ подтвержден менеджером Службы доставки до 12:00, товар может быть доставлен на следующий рабочий день между 10:00 и 15:00 или между 15:00 и 20:00;\rесли заказ подтвержден менеджером Службы доставки после 12:00, товар может быть доставлен на следующий рабочий день между 15:00 и 18:00.\rВы также можете указать любое другое удобное время доставки, и покупка будет доставлена в удобное Вам время. Иное время доставки, а также время доставки в населенные пункты области определяется по договоренности с клиентом.\rМесто доставки\rДоставка осуществляется по адресу, указанному при оформлении заказа. Если необходимо доставить товар по иному адресу, необходимо сообщить адрес менеджеру Службы доставки, который свяжется с Вами непосредственно после оформления заказа на сайте.\rПравила\rПри доставке Вам будут переданы все необходимые документы на покупку: товарный, кассовый чеки, а также гарантийный талон.При оформлении покупки на организацию, Вам будут переданы счет-фактура, а также накладная, в которой необходимо поставить печать Вашей организации.Цена, указанная в переданных Вам курьером документах, является окончательной, курьер не обладает правом корректировки цены.Стоимость доставки выделяется в документах на покупку отдельной графой.\rВнимание!\rПросим Вас помнить, что все технические параметры и потребительские свойства приобретаемого товара Вам следует уточнять у нашего менеджера до момента покупки товара. В обязанности работников Службы доставки не входит осуществление консультаций и комментариев относительно потребительских свойств товара. При необходимости инсталляции приобретаемого в нашем магазине товара Вам необходимо сообщить об этом нашему менеджеру.При доставке Вам заказанного товара проверяйте комплектность доставленного товара, работоспособность товара, соответствие доставленного товара описанию на нашем сайте, также проверьте товар на наличие механических повреждений. При не заявлении Вами при получении товара претензий по поводу механических повреждений, в дальнейшем подобные претензии не рассматриваются.В случае вопросов, пожеланий и претензий обращайтесь к нам по следующим координатам:\rСлужба доставки\r: #SALE_PHONE# (многоканальный).\rЭлектронная почта\r: \r#SALE_EMAIL#\rSkype\r: \rshipping.example.ru','','ДОСТАВКА\r\nИНТЕРНЕТ-МАГАЗИН ВЫПОЛНЯЕТ ДОСТАВКУ ЛЮБОГО ТОВАРА СВОЕЙ СОБСТВЕННОЙ СЛУЖБОЙ ДОСТАВКИ.\rСТОИМОСТЬ ДОСТАВКИ КУРЬЕРОМ\rСТОИМОСТЬ ДОСТАВКИ ТОВАРА ИЗ НАШЕГО МАГАЗИНА - 500 РУБ, ПРИ УСЛОВИИ ВЫБОРА ПРИ ЗАКАЗЕ ТОВАРА В КАЧЕСТВЕ СПОСОБА ДОСТАВКИ НАШИМ КУРЬЕРОМ.\rВРЕМЯ ДОСТАВКИ\rВРЕМЯ ДОСТАВКИ СОГЛАСОВЫВАЕТСЯ С МЕНЕДЖЕРОМ СЛУЖБЫ ДОСТАВКИ, КОТОРЫЙ ОБЯЗАТЕЛЬНО СВЯЖЕТСЯ С ВАМИ СРАЗУ ПОСЛЕ ТОГО, КАК ВЫ РАЗМЕСТИТЕ СВОЙ ЗАКАЗ. \rВНИМАНИЕ!\rНЕПРАВИЛЬНО УКАЗАННЫЙ НОМЕР ТЕЛЕФОНА, НЕТОЧНЫЙ ИЛИ НЕПОЛНЫЙ АДРЕС МОГУТ ПРИВЕСТИ К ДОПОЛНИТЕЛЬНОЙ ЗАДЕРЖКЕ! ПОЖАЛУЙСТА, ВНИМАТЕЛЬНО ПРОВЕРЯЙТЕ ВАШИ ПЕРСОНАЛЬНЫЕ ДАННЫЕ ПРИ РЕГИСТРАЦИИ И ОФОРМЛЕНИИ ЗАКАЗА.КОНФИДЕНЦИАЛЬНОСТЬ ВАШИХ РЕГИСТРАЦИОННЫХ ДАННЫХ ГАРАНТИРУЕТСЯ.\rДОСТАВКА ВЫПОЛНЯЕТСЯ ЕЖЕДНЕВНО С 10:00 ДО 20:00 ЧАСОВ, В СУББОТУ С 10:00 ДО 14:00, В ВОСКРЕСЕНЬЕ ДОСТАВКИ НЕТ. ТОВАРЫ, ЗАКАЗАННЫЕ ВАМИ В СУББОТУ И ВОСКРЕСЕНЬЕ, ДОСТАВЛЯЮТСЯ В ПОНЕДЕЛЬНИК. ВРЕМЯ ОСУЩЕСТВЛЕНИЯ ДОСТАВКИ ЗАВИСИТ ОТ ВРЕМЕНИ РАЗМЕЩЕНИЯ ЗАКАЗА И НАЛИЧИЯ ТОВАРА НА СКЛАДЕ:\rЕСЛИ ЗАКАЗ ПОДТВЕРЖДЕН МЕНЕДЖЕРОМ СЛУЖБЫ ДОСТАВКИ ДО 12:00, ТОВАР МОЖЕТ БЫТЬ ДОСТАВЛЕН НА СЛЕДУЮЩИЙ РАБОЧИЙ ДЕНЬ МЕЖДУ 10:00 И 15:00 ИЛИ МЕЖДУ 15:00 И 20:00;\rЕСЛИ ЗАКАЗ ПОДТВЕРЖДЕН МЕНЕДЖЕРОМ СЛУЖБЫ ДОСТАВКИ ПОСЛЕ 12:00, ТОВАР МОЖЕТ БЫТЬ ДОСТАВЛЕН НА СЛЕДУЮЩИЙ РАБОЧИЙ ДЕНЬ МЕЖДУ 15:00 И 18:00.\rВЫ ТАКЖЕ МОЖЕТЕ УКАЗАТЬ ЛЮБОЕ ДРУГОЕ УДОБНОЕ ВРЕМЯ ДОСТАВКИ, И ПОКУПКА БУДЕТ ДОСТАВЛЕНА В УДОБНОЕ ВАМ ВРЕМЯ. ИНОЕ ВРЕМЯ ДОСТАВКИ, А ТАКЖЕ ВРЕМЯ ДОСТАВКИ В НАСЕЛЕННЫЕ ПУНКТЫ ОБЛАСТИ ОПРЕДЕЛЯЕТСЯ ПО ДОГОВОРЕННОСТИ С КЛИЕНТОМ.\rМЕСТО ДОСТАВКИ\rДОСТАВКА ОСУЩЕСТВЛЯЕТСЯ ПО АДРЕСУ, УКАЗАННОМУ ПРИ ОФОРМЛЕНИИ ЗАКАЗА. ЕСЛИ НЕОБХОДИМО ДОСТАВИТЬ ТОВАР ПО ИНОМУ АДРЕСУ, НЕОБХОДИМО СООБЩИТЬ АДРЕС МЕНЕДЖЕРУ СЛУЖБЫ ДОСТАВКИ, КОТОРЫЙ СВЯЖЕТСЯ С ВАМИ НЕПОСРЕДСТВЕННО ПОСЛЕ ОФОРМЛЕНИЯ ЗАКАЗА НА САЙТЕ.\rПРАВИЛА\rПРИ ДОСТАВКЕ ВАМ БУДУТ ПЕРЕДАНЫ ВСЕ НЕОБХОДИМЫЕ ДОКУМЕНТЫ НА ПОКУПКУ: ТОВАРНЫЙ, КАССОВЫЙ ЧЕКИ, А ТАКЖЕ ГАРАНТИЙНЫЙ ТАЛОН.ПРИ ОФОРМЛЕНИИ ПОКУПКИ НА ОРГАНИЗАЦИЮ, ВАМ БУДУТ ПЕРЕДАНЫ СЧЕТ-ФАКТУРА, А ТАКЖЕ НАКЛАДНАЯ, В КОТОРОЙ НЕОБХОДИМО ПОСТАВИТЬ ПЕЧАТЬ ВАШЕЙ ОРГАНИЗАЦИИ.ЦЕНА, УКАЗАННАЯ В ПЕРЕДАННЫХ ВАМ КУРЬЕРОМ ДОКУМЕНТАХ, ЯВЛЯЕТСЯ ОКОНЧАТЕЛЬНОЙ, КУРЬЕР НЕ ОБЛАДАЕТ ПРАВОМ КОРРЕКТИРОВКИ ЦЕНЫ.СТОИМОСТЬ ДОСТАВКИ ВЫДЕЛЯЕТСЯ В ДОКУМЕНТАХ НА ПОКУПКУ ОТДЕЛЬНОЙ ГРАФОЙ.\rВНИМАНИЕ!\rПРОСИМ ВАС ПОМНИТЬ, ЧТО ВСЕ ТЕХНИЧЕСКИЕ ПАРАМЕТРЫ И ПОТРЕБИТЕЛЬСКИЕ СВОЙСТВА ПРИОБРЕТАЕМОГО ТОВАРА ВАМ СЛЕДУЕТ УТОЧНЯТЬ У НАШЕГО МЕНЕДЖЕРА ДО МОМЕНТА ПОКУПКИ ТОВАРА. В ОБЯЗАННОСТИ РАБОТНИКОВ СЛУЖБЫ ДОСТАВКИ НЕ ВХОДИТ ОСУЩЕСТВЛЕНИЕ КОНСУЛЬТАЦИЙ И КОММЕНТАРИЕВ ОТНОСИТЕЛЬНО ПОТРЕБИТЕЛЬСКИХ СВОЙСТВ ТОВАРА. ПРИ НЕОБХОДИМОСТИ ИНСТАЛЛЯЦИИ ПРИОБРЕТАЕМОГО В НАШЕМ МАГАЗИНЕ ТОВАРА ВАМ НЕОБХОДИМО СООБЩИТЬ ОБ ЭТОМ НАШЕМУ МЕНЕДЖЕРУ.ПРИ ДОСТАВКЕ ВАМ ЗАКАЗАННОГО ТОВАРА ПРОВЕРЯЙТЕ КОМПЛЕКТНОСТЬ ДОСТАВЛЕННОГО ТОВАРА, РАБОТОСПОСОБНОСТЬ ТОВАРА, СООТВЕТСТВИЕ ДОСТАВЛЕННОГО ТОВАРА ОПИСАНИЮ НА НАШЕМ САЙТЕ, ТАКЖЕ ПРОВЕРЬТЕ ТОВАР НА НАЛИЧИЕ МЕХАНИЧЕСКИХ ПОВРЕЖДЕНИЙ. ПРИ НЕ ЗАЯВЛЕНИИ ВАМИ ПРИ ПОЛУЧЕНИИ ТОВАРА ПРЕТЕНЗИЙ ПО ПОВОДУ МЕХАНИЧЕСКИХ ПОВРЕЖДЕНИЙ, В ДАЛЬНЕЙШЕМ ПОДОБНЫЕ ПРЕТЕНЗИИ НЕ РАССМАТРИВАЮТСЯ.В СЛУЧАЕ ВОПРОСОВ, ПОЖЕЛАНИЙ И ПРЕТЕНЗИЙ ОБРАЩАЙТЕСЬ К НАМ ПО СЛЕДУЮЩИМ КООРДИНАТАМ:\rСЛУЖБА ДОСТАВКИ\r: #SALE_PHONE# (МНОГОКАНАЛЬНЫЙ).\rЭЛЕКТРОННАЯ ПОЧТА\r: \r#SALE_EMAIL#\rSKYPE\r: \rSHIPPING.EXAMPLE.RU\r\n','','','99430ae9c704754a21fb9fdae6b396ff',NULL,NULL),(3,'2011-05-26 18:18:23','main','s1|/about/faq/index.php','s1',0,'/about/faq/index.php','Помощь покупателю','В этом разделе Вы можете найти ответы на многие вопросы, касающиеся работы нашего сайта. Если Вы не нашли интересующей Вас информации, то можете отправить нам запрос с помощью \rформы обратной связи\r.','','ПОМОЩЬ ПОКУПАТЕЛЮ\r\nВ ЭТОМ РАЗДЕЛЕ ВЫ МОЖЕТЕ НАЙТИ ОТВЕТЫ НА МНОГИЕ ВОПРОСЫ, КАСАЮЩИЕСЯ РАБОТЫ НАШЕГО САЙТА. ЕСЛИ ВЫ НЕ НАШЛИ ИНТЕРЕСУЮЩЕЙ ВАС ИНФОРМАЦИИ, ТО МОЖЕТЕ ОТПРАВИТЬ НАМ ЗАПРОС С ПОМОЩЬЮ \rФОРМЫ ОБРАТНОЙ СВЯЗИ\r.\r\n','','','99430ae9c704754a21fb9fdae6b396ff',NULL,NULL),(4,'2011-05-26 18:18:23','main','s1|/about/howto/index.php','s1',0,'/about/howto/index.php','Как купить','Процедура покупки товара в нашем Интернет-магазине очень проста и состоит из нескольких шагов.\r1. Оформление заказа\rПосле выбора товара нажмите кнопку \rВ корзину\r— товар добавится в Вашу корзину.\rДалее, если вы закончили выбирать товар, нажмите кнопку \rВаша корзина\r.\rНа странице \rВаша корзина\rбудут перечислены все выбранные Вами товары.\rВ поле \rКоличество\rВы пожете изменить количество товара для покупки. После изменения количества товара необходимо нажать кнопку \rПересчитать\rдля пересчета итоговой суммы заказа.\nВ колонке \rДействия\rнад каждым товаром можно произвести следующие действия: либо \rудалить\rтовар из корзины, либо \rотложить\rтовар на будущее.\rТакже можно ввести код скидки в соответствующее поле.\r2. Оформление и подтверждение заказа\rПосле ввода необходимой информации о доставке товара (ФИО получателя, адрес доставки, контактные данные, вариант доставки, способ оплаты и т.д) для оформления заказа Вам нужно нажать кнопку \rОформить заказ\r.\rКопия заказа будет выслана на Ваш e-mail, указанный при оформлении заказа.\rВнимание!\rНеправильно указанный номер телефона, неточный или неполный адрес могут привести к дополнительной задержке! Пожалуйста, внимательно проверяйте Ваши персональные данные при регистрации и оформлении заказа.\rЧерез некоторое время (обычно в течение часа) после оформления покупки, с Вами свяжется наш менеджер по контактным данным, указанным при оформлении заказа. С менеджером можно будет согласовать точное время и сроки доставки, а также уточнить детали.\rПримечание\r: Для постоянных клиентов на сайте магазина есть \rРегистрация\r. В своем кабинете Вы можете просмотреть содержимое корзины, историю своих заказов, а также повторить или отказаться от заказа, подписаться на рассылку новостей магазина.\r3. Оплата и цены\rЦены, указанные на сайте, являются окончательными и не требуют доплат при стандартных условиях поставки. Все налоги включены в стоимость товара.\rВнимание!\rДля каждого отдельного заказа возможен только один способ оплаты на ваш выбор. Оплата заказа по частям различными способами невозможна.\rВозможные способы оплаты:\rНаличный расчет\r. \nОплата производится наличными курьеру при доставке или в магазине при самовывозе. Вместе с товаром передается товарный и кассовый чеки, а также гарантийный талон.\rОплата через Сбербанк\r. \nВы можете оплатить заказ в любом отделении Сбербанка. За услугу по переводу денег с Вас возьмут от 3 до 7% от стоимости заказа, в зависимости от региона. Перечисление денег займет порядка 10 дней.','','КАК КУПИТЬ\r\nПРОЦЕДУРА ПОКУПКИ ТОВАРА В НАШЕМ ИНТЕРНЕТ-МАГАЗИНЕ ОЧЕНЬ ПРОСТА И СОСТОИТ ИЗ НЕСКОЛЬКИХ ШАГОВ.\r1. ОФОРМЛЕНИЕ ЗАКАЗА\rПОСЛЕ ВЫБОРА ТОВАРА НАЖМИТЕ КНОПКУ \rВ КОРЗИНУ\r— ТОВАР ДОБАВИТСЯ В ВАШУ КОРЗИНУ.\rДАЛЕЕ, ЕСЛИ ВЫ ЗАКОНЧИЛИ ВЫБИРАТЬ ТОВАР, НАЖМИТЕ КНОПКУ \rВАША КОРЗИНА\r.\rНА СТРАНИЦЕ \rВАША КОРЗИНА\rБУДУТ ПЕРЕЧИСЛЕНЫ ВСЕ ВЫБРАННЫЕ ВАМИ ТОВАРЫ.\rВ ПОЛЕ \rКОЛИЧЕСТВО\rВЫ ПОЖЕТЕ ИЗМЕНИТЬ КОЛИЧЕСТВО ТОВАРА ДЛЯ ПОКУПКИ. ПОСЛЕ ИЗМЕНЕНИЯ КОЛИЧЕСТВА ТОВАРА НЕОБХОДИМО НАЖАТЬ КНОПКУ \rПЕРЕСЧИТАТЬ\rДЛЯ ПЕРЕСЧЕТА ИТОГОВОЙ СУММЫ ЗАКАЗА.\nВ КОЛОНКЕ \rДЕЙСТВИЯ\rНАД КАЖДЫМ ТОВАРОМ МОЖНО ПРОИЗВЕСТИ СЛЕДУЮЩИЕ ДЕЙСТВИЯ: ЛИБО \rУДАЛИТЬ\rТОВАР ИЗ КОРЗИНЫ, ЛИБО \rОТЛОЖИТЬ\rТОВАР НА БУДУЩЕЕ.\rТАКЖЕ МОЖНО ВВЕСТИ КОД СКИДКИ В СООТВЕТСТВУЮЩЕЕ ПОЛЕ.\r2. ОФОРМЛЕНИЕ И ПОДТВЕРЖДЕНИЕ ЗАКАЗА\rПОСЛЕ ВВОДА НЕОБХОДИМОЙ ИНФОРМАЦИИ О ДОСТАВКЕ ТОВАРА (ФИО ПОЛУЧАТЕЛЯ, АДРЕС ДОСТАВКИ, КОНТАКТНЫЕ ДАННЫЕ, ВАРИАНТ ДОСТАВКИ, СПОСОБ ОПЛАТЫ И Т.Д) ДЛЯ ОФОРМЛЕНИЯ ЗАКАЗА ВАМ НУЖНО НАЖАТЬ КНОПКУ \rОФОРМИТЬ ЗАКАЗ\r.\rКОПИЯ ЗАКАЗА БУДЕТ ВЫСЛАНА НА ВАШ E-MAIL, УКАЗАННЫЙ ПРИ ОФОРМЛЕНИИ ЗАКАЗА.\rВНИМАНИЕ!\rНЕПРАВИЛЬНО УКАЗАННЫЙ НОМЕР ТЕЛЕФОНА, НЕТОЧНЫЙ ИЛИ НЕПОЛНЫЙ АДРЕС МОГУТ ПРИВЕСТИ К ДОПОЛНИТЕЛЬНОЙ ЗАДЕРЖКЕ! ПОЖАЛУЙСТА, ВНИМАТЕЛЬНО ПРОВЕРЯЙТЕ ВАШИ ПЕРСОНАЛЬНЫЕ ДАННЫЕ ПРИ РЕГИСТРАЦИИ И ОФОРМЛЕНИИ ЗАКАЗА.\rЧЕРЕЗ НЕКОТОРОЕ ВРЕМЯ (ОБЫЧНО В ТЕЧЕНИЕ ЧАСА) ПОСЛЕ ОФОРМЛЕНИЯ ПОКУПКИ, С ВАМИ СВЯЖЕТСЯ НАШ МЕНЕДЖЕР ПО КОНТАКТНЫМ ДАННЫМ, УКАЗАННЫМ ПРИ ОФОРМЛЕНИИ ЗАКАЗА. С МЕНЕДЖЕРОМ МОЖНО БУДЕТ СОГЛАСОВАТЬ ТОЧНОЕ ВРЕМЯ И СРОКИ ДОСТАВКИ, А ТАКЖЕ УТОЧНИТЬ ДЕТАЛИ.\rПРИМЕЧАНИЕ\r: ДЛЯ ПОСТОЯННЫХ КЛИЕНТОВ НА САЙТЕ МАГАЗИНА ЕСТЬ \rРЕГИСТРАЦИЯ\r. В СВОЕМ КАБИНЕТЕ ВЫ МОЖЕТЕ ПРОСМОТРЕТЬ СОДЕРЖИМОЕ КОРЗИНЫ, ИСТОРИЮ СВОИХ ЗАКАЗОВ, А ТАКЖЕ ПОВТОРИТЬ ИЛИ ОТКАЗАТЬСЯ ОТ ЗАКАЗА, ПОДПИСАТЬСЯ НА РАССЫЛКУ НОВОСТЕЙ МАГАЗИНА.\r3. ОПЛАТА И ЦЕНЫ\rЦЕНЫ, УКАЗАННЫЕ НА САЙТЕ, ЯВЛЯЮТСЯ ОКОНЧАТЕЛЬНЫМИ И НЕ ТРЕБУЮТ ДОПЛАТ ПРИ СТАНДАРТНЫХ УСЛОВИЯХ ПОСТАВКИ. ВСЕ НАЛОГИ ВКЛЮЧЕНЫ В СТОИМОСТЬ ТОВАРА.\rВНИМАНИЕ!\rДЛЯ КАЖДОГО ОТДЕЛЬНОГО ЗАКАЗА ВОЗМОЖЕН ТОЛЬКО ОДИН СПОСОБ ОПЛАТЫ НА ВАШ ВЫБОР. ОПЛАТА ЗАКАЗА ПО ЧАСТЯМ РАЗЛИЧНЫМИ СПОСОБАМИ НЕВОЗМОЖНА.\rВОЗМОЖНЫЕ СПОСОБЫ ОПЛАТЫ:\rНАЛИЧНЫЙ РАСЧЕТ\r. \nОПЛАТА ПРОИЗВОДИТСЯ НАЛИЧНЫМИ КУРЬЕРУ ПРИ ДОСТАВКЕ ИЛИ В МАГАЗИНЕ ПРИ САМОВЫВОЗЕ. ВМЕСТЕ С ТОВАРОМ ПЕРЕДАЕТСЯ ТОВАРНЫЙ И КАССОВЫЙ ЧЕКИ, А ТАКЖЕ ГАРАНТИЙНЫЙ ТАЛОН.\rОПЛАТА ЧЕРЕЗ СБЕРБАНК\r. \nВЫ МОЖЕТЕ ОПЛАТИТЬ ЗАКАЗ В ЛЮБОМ ОТДЕЛЕНИИ СБЕРБАНКА. ЗА УСЛУГУ ПО ПЕРЕВОДУ ДЕНЕГ С ВАС ВОЗЬМУТ ОТ 3 ДО 7% ОТ СТОИМОСТИ ЗАКАЗА, В ЗАВИСИМОСТИ ОТ РЕГИОНА. ПЕРЕЧИСЛЕНИЕ ДЕНЕГ ЗАЙМЕТ ПОРЯДКА 10 ДНЕЙ.\r\n','','','99430ae9c704754a21fb9fdae6b396ff',NULL,NULL),(5,'2011-05-26 18:18:23','main','s1|/about/index.php','s1',0,'/about/index.php','О магазине','Мы рады приветствовать Вас на сайте нашей компании.\rНаша компания была основана в 1993 году, а наш интернет-магазин стал одним из первых магазинов, осуществляющих on-line продажу мебели в регионе. Компания специализируется на оптовой и розничной продаже мебели как для дома, так и для офиса и производственных помещений, а также различной мебельной фурнитуры.\rНа данный момент мы представляем собой крупную компанию, владеющую интернет&ndash;магазином и имеющую в своей сети единый call-центр, который регулирует всю деятельность магазина, отдел продаж, службу доставки, широкий штат квалифицированных сборщиков, собственный склад c постоянным наличием необходимого запаса товаров.\rЗа это время у нас сложились партнерские отношения с ведущими производителями, позволяющие предлагать высококачественную продукцию по конкурентоспособным ценам.\rМы можем гордиться тем, что у нас один из самых широких ассортиментов мебели в городе и области. \rНа нашем сайте к Вашим услугам:\rреальные и конкурентоспособные цены;\rширочайший ассортимент товаров;\rкачественные описания и изображения товаров;\rпоиск товаров в магазине;\rсистема обратной связи;\rпродажа только сертифицированных и имеющих легальное происхождение товаров;\rгарантийное обслуживание купленных у нас товаров;\rпокупка товара, не выходя из дома или офиса;\rбыстрое согласование товара с клиентом для подтверждения заказа;\rобмен товаров ненадлежащего качества и многое другое.\rМы всегда рады общению с нашими клиентами. Если у Вас есть какие-либо пожелания, предложения, замечания, касающиеся работы нашего Интернет-магазина - пишите нам, и мы с благодарностью примем Ваше мнение во внимание:\rЭлектронная почта\r: \r#SALE_EMAIL#','','О МАГАЗИНЕ\r\nМЫ РАДЫ ПРИВЕТСТВОВАТЬ ВАС НА САЙТЕ НАШЕЙ КОМПАНИИ.\rНАША КОМПАНИЯ БЫЛА ОСНОВАНА В 1993 ГОДУ, А НАШ ИНТЕРНЕТ-МАГАЗИН СТАЛ ОДНИМ ИЗ ПЕРВЫХ МАГАЗИНОВ, ОСУЩЕСТВЛЯЮЩИХ ON-LINE ПРОДАЖУ МЕБЕЛИ В РЕГИОНЕ. КОМПАНИЯ СПЕЦИАЛИЗИРУЕТСЯ НА ОПТОВОЙ И РОЗНИЧНОЙ ПРОДАЖЕ МЕБЕЛИ КАК ДЛЯ ДОМА, ТАК И ДЛЯ ОФИСА И ПРОИЗВОДСТВЕННЫХ ПОМЕЩЕНИЙ, А ТАКЖЕ РАЗЛИЧНОЙ МЕБЕЛЬНОЙ ФУРНИТУРЫ.\rНА ДАННЫЙ МОМЕНТ МЫ ПРЕДСТАВЛЯЕМ СОБОЙ КРУПНУЮ КОМПАНИЮ, ВЛАДЕЮЩУЮ ИНТЕРНЕТМАГАЗИНОМ И ИМЕЮЩУЮ В СВОЕЙ СЕТИ ЕДИНЫЙ CALL-ЦЕНТР, КОТОРЫЙ РЕГУЛИРУЕТ ВСЮ ДЕЯТЕЛЬНОСТЬ МАГАЗИНА, ОТДЕЛ ПРОДАЖ, СЛУЖБУ ДОСТАВКИ, ШИРОКИЙ ШТАТ КВАЛИФИЦИРОВАННЫХ СБОРЩИКОВ, СОБСТВЕННЫЙ СКЛАД C ПОСТОЯННЫМ НАЛИЧИЕМ НЕОБХОДИМОГО ЗАПАСА ТОВАРОВ.\rЗА ЭТО ВРЕМЯ У НАС СЛОЖИЛИСЬ ПАРТНЕРСКИЕ ОТНОШЕНИЯ С ВЕДУЩИМИ ПРОИЗВОДИТЕЛЯМИ, ПОЗВОЛЯЮЩИЕ ПРЕДЛАГАТЬ ВЫСОКОКАЧЕСТВЕННУЮ ПРОДУКЦИЮ ПО КОНКУРЕНТОСПОСОБНЫМ ЦЕНАМ.\rМЫ МОЖЕМ ГОРДИТЬСЯ ТЕМ, ЧТО У НАС ОДИН ИЗ САМЫХ ШИРОКИХ АССОРТИМЕНТОВ МЕБЕЛИ В ГОРОДЕ И ОБЛАСТИ. \rНА НАШЕМ САЙТЕ К ВАШИМ УСЛУГАМ:\rРЕАЛЬНЫЕ И КОНКУРЕНТОСПОСОБНЫЕ ЦЕНЫ;\rШИРОЧАЙШИЙ АССОРТИМЕНТ ТОВАРОВ;\rКАЧЕСТВЕННЫЕ ОПИСАНИЯ И ИЗОБРАЖЕНИЯ ТОВАРОВ;\rПОИСК ТОВАРОВ В МАГАЗИНЕ;\rСИСТЕМА ОБРАТНОЙ СВЯЗИ;\rПРОДАЖА ТОЛЬКО СЕРТИФИЦИРОВАННЫХ И ИМЕЮЩИХ ЛЕГАЛЬНОЕ ПРОИСХОЖДЕНИЕ ТОВАРОВ;\rГАРАНТИЙНОЕ ОБСЛУЖИВАНИЕ КУПЛЕННЫХ У НАС ТОВАРОВ;\rПОКУПКА ТОВАРА, НЕ ВЫХОДЯ ИЗ ДОМА ИЛИ ОФИСА;\rБЫСТРОЕ СОГЛАСОВАНИЕ ТОВАРА С КЛИЕНТОМ ДЛЯ ПОДТВЕРЖДЕНИЯ ЗАКАЗА;\rОБМЕН ТОВАРОВ НЕНАДЛЕЖАЩЕГО КАЧЕСТВА И МНОГОЕ ДРУГОЕ.\rМЫ ВСЕГДА РАДЫ ОБЩЕНИЮ С НАШИМИ КЛИЕНТАМИ. ЕСЛИ У ВАС ЕСТЬ КАКИЕ-ЛИБО ПОЖЕЛАНИЯ, ПРЕДЛОЖЕНИЯ, ЗАМЕЧАНИЯ, КАСАЮЩИЕСЯ РАБОТЫ НАШЕГО ИНТЕРНЕТ-МАГАЗИНА - ПИШИТЕ НАМ, И МЫ С БЛАГОДАРНОСТЬЮ ПРИМЕМ ВАШЕ МНЕНИЕ ВО ВНИМАНИЕ:\rЭЛЕКТРОННАЯ ПОЧТА\r: \r#SALE_EMAIL#\r\n','','','99430ae9c704754a21fb9fdae6b396ff',NULL,NULL),(6,'2011-05-26 18:18:23','main','s1|/catalog/furniture/index.php','s1',0,'/catalog/furniture/index.php','Каталог','Для удаления данного демонстрационного каталога воспользуйтесь выпадающим меню кнопки Мастер настройки на административной панели. \nДля этого авторизуйтесь, нажмите на стрелочку возле кнопки Мастер настройки и в меню выберите пункт Удалить демо-каталог.\nИспользуйте это меню также для добавления нового каталога.','','КАТАЛОГ\r\nДЛЯ УДАЛЕНИЯ ДАННОГО ДЕМОНСТРАЦИОННОГО КАТАЛОГА ВОСПОЛЬЗУЙТЕСЬ ВЫПАДАЮЩИМ МЕНЮ КНОПКИ МАСТЕР НАСТРОЙКИ НА АДМИНИСТРАТИВНОЙ ПАНЕЛИ. \nДЛЯ ЭТОГО АВТОРИЗУЙТЕСЬ, НАЖМИТЕ НА СТРЕЛОЧКУ ВОЗЛЕ КНОПКИ МАСТЕР НАСТРОЙКИ И В МЕНЮ ВЫБЕРИТЕ ПУНКТ УДАЛИТЬ ДЕМО-КАТАЛОГ.\nИСПОЛЬЗУЙТЕ ЭТО МЕНЮ ТАКЖЕ ДЛЯ ДОБАВЛЕНИЯ НОВОГО КАТАЛОГА.\r\n','','','99430ae9c704754a21fb9fdae6b396ff',NULL,NULL),(7,'2011-08-17 15:25:47','main','s1|/catalog/index.php','s1',0,'/catalog/index.php','Outdoor секция','Показать \r-->\n Показать свободные\rc даты \rна \rдней','','OUTDOOR СЕКЦИЯ\r\nПОКАЗАТЬ \r-->\n ПОКАЗАТЬ СВОБОДНЫЕ\rC ДАТЫ \rНА \rДНЕЙ\r\n','','','99430ae9c704754a21fb9fdae6b396ff',NULL,NULL),(8,'2011-05-26 18:18:23','main','s1|/login/index.php','s1',0,'/login/index.php','Вход на сайт','Вы зарегистрированы и успешно авторизовались.\rВернуться на главную страницу','','ВХОД НА САЙТ\r\nВЫ ЗАРЕГИСТРИРОВАНЫ И УСПЕШНО АВТОРИЗОВАЛИСЬ.\rВЕРНУТЬСЯ НА ГЛАВНУЮ СТРАНИЦУ\r\n','','','99430ae9c704754a21fb9fdae6b396ff',NULL,NULL),(9,'2011-05-26 18:18:23','main','s1|/news/index.php','s1',0,'/news/index.php','Официальная информация','','','ОФИЦИАЛЬНАЯ ИНФОРМАЦИЯ\r\n\r\n','','','99430ae9c704754a21fb9fdae6b396ff',NULL,NULL),(10,'2011-06-15 22:15:31','main','s1|/personal/cart/index.php','s1',0,'/personal/cart/index.php','Корзина','','','КОРЗИНА\r\n\r\n','','','99430ae9c704754a21fb9fdae6b396ff',NULL,NULL),(11,'2011-05-26 18:18:23','main','s1|/personal/index.php','s1',0,'/personal/index.php','Персональный раздел','В личном кабинете Вы можете проверить текущее состояние корзины, ход выполнения Ваших заказов, просмотреть или изменить личную информацию, а также подписаться на новости и другие информационные рассылки. \rЛичная информация\rИзменить регистрационные данные\rИзменить пароль\rЗабыли пароль?\rЗаказы\rОзнакомиться с состоянием заказов\rПосмотреть содержимое корзины\rПосмотреть отложенные товары\rПосмотреть историю заказов\rПодписка\rИзменить подписку','','ПЕРСОНАЛЬНЫЙ РАЗДЕЛ\r\nВ ЛИЧНОМ КАБИНЕТЕ ВЫ МОЖЕТЕ ПРОВЕРИТЬ ТЕКУЩЕЕ СОСТОЯНИЕ КОРЗИНЫ, ХОД ВЫПОЛНЕНИЯ ВАШИХ ЗАКАЗОВ, ПРОСМОТРЕТЬ ИЛИ ИЗМЕНИТЬ ЛИЧНУЮ ИНФОРМАЦИЮ, А ТАКЖЕ ПОДПИСАТЬСЯ НА НОВОСТИ И ДРУГИЕ ИНФОРМАЦИОННЫЕ РАССЫЛКИ. \rЛИЧНАЯ ИНФОРМАЦИЯ\rИЗМЕНИТЬ РЕГИСТРАЦИОННЫЕ ДАННЫЕ\rИЗМЕНИТЬ ПАРОЛЬ\rЗАБЫЛИ ПАРОЛЬ?\rЗАКАЗЫ\rОЗНАКОМИТЬСЯ С СОСТОЯНИЕМ ЗАКАЗОВ\rПОСМОТРЕТЬ СОДЕРЖИМОЕ КОРЗИНЫ\rПОСМОТРЕТЬ ОТЛОЖЕННЫЕ ТОВАРЫ\rПОСМОТРЕТЬ ИСТОРИЮ ЗАКАЗОВ\rПОДПИСКА\rИЗМЕНИТЬ ПОДПИСКУ\r\n','','','99430ae9c704754a21fb9fdae6b396ff',NULL,NULL),(12,'2011-06-15 22:27:47','main','s1|/personal/order/index.php','s1',0,'/personal/order/index.php','Заказы','','','ЗАКАЗЫ\r\n\r\n','','','99430ae9c704754a21fb9fdae6b396ff',NULL,NULL),(13,'2011-08-15 21:59:10','main','s1|/personal/order/make/index.php','s1',0,'/personal/order/make/index.php','Заказы','','','ЗАКАЗЫ\r\n\r\n','','','99430ae9c704754a21fb9fdae6b396ff',NULL,NULL),(14,'2011-05-26 18:18:23','main','s1|/personal/order/payment/index.ph