1fb9fdae6b396ff',NULL,NULL),(21,'2011-05-26 18:18:23','main','s1|/_index_.php','s1',0,'/_index_.php','Интернет-магазин \"Мебель\"','Работаем все праздники без выходных с 10 до 18, доставка день в день 9 - 22.\rДобро пожаловать в мебельный интернет-магазин! Мы предлагаем широкий ассортимент качественной мебели по адекватным ценам. Покупая мебель в нашем Интернет-магазине, вы можете быть уверены в качестве мебели - ведь мы работаем только с крупными и проверенными производителями.','','ИНТЕРНЕТ-МАГАЗИН \"МЕБЕЛЬ\"\r\nРАБОТАЕМ ВСЕ ПРАЗДНИКИ БЕЗ ВЫХОДНЫХ С 10 ДО 18, ДОСТАВКА ДЕНЬ В ДЕНЬ 9 - 22.\rДОБРО ПОЖАЛОВАТЬ В МЕБЕЛЬНЫЙ ИНТЕРНЕТ-МАГАЗИН! МЫ ПРЕДЛАГАЕМ ШИРОКИЙ АССОРТИМЕНТ КАЧЕСТВЕННОЙ МЕБЕЛИ ПО АДЕКВАТНЫМ ЦЕНАМ. ПОКУПАЯ МЕБЕЛЬ В НАШЕМ ИНТЕРНЕТ-МАГАЗИНЕ, ВЫ МОЖЕТЕ БЫТЬ УВЕРЕНЫ В КАЧЕСТВЕ МЕБЕЛИ - ВЕДЬ МЫ РАБОТАЕМ ТОЛЬКО С КРУПНЫМИ И ПРОВЕРЕННЫМИ ПРОИЗВОДИТЕЛЯМИ.\r\n','','','99430ae9c704754a21fb9fdae6b396ff',NULL,NULL),(22,'2010-11-25 00:00:00','iblock','1','s1',0,'=ID=1&EXTERNAL_ID=1&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=news&IBLOCK_ID=1&IBLOCK_CODE=furniture_news&IBLOCK_EXTERNAL_ID=furniture_news&CODE=furniture_forum_belarus','Мебельный форум Беларуси','С 20 по 23 апреля 2010 года состоится \rМебельный Форум Беларуси\r&ndash; важнейшее мероприятии отрасли в текущем году.\r\n\rС 20 по 23 апреля 2010 года состоится \rМебельный Форум Беларуси\r&ndash; важнейшее мероприятии отрасли в текущем году. В экспозиции принимают участие свыше 160 компаний из \rБеларуси, Австрии, Латвии, Литвы, России, Польши \rи\rУкраины\r. В составе форума состоится пять выставок:\"Минский мебельный салон\", \"Мебельные технологии\", \"ОфисКомфорт\", \"Кухня\" и \"Домотех\". Экспозиция будет строиться по принципу двух тематических секторов:\rготовой мебели\rи \rматериалов для ее производства\r.\rВ секторе готовой мебели будут представлены:\rкорпусная и мягкая мебель;\rмебель для детей и молодежи;\rпредметы интерьера;\rкухонная мебель;\rмебель для офиса и административных зданий.\rВ секторе материалов для производства мебели будут демонстрироваться новинки рынка мебельной фурнитуры, материалов, обивочных тканей, элементов и аксессуаров для производства мебели.\rПомимо расширенной экспозиции пяти тематических выставок \"Экспофорум\" подготовил разнообразную деловую программу Мебельного форума. В рамках выставки состоятся семинары и мастер-классы. И поистине масштабным в этом году обещает стать республиканский конкурс форума \"\rНародное признание\r\". В этом году он выходит за рамки выставки и становится республиканским смотром образцов мебели.\rМебельный Форум\rпредоставляет специалистам возможность познакомиться с тенденциями мебельной моды, провести переговоры, получить практические предложения рынка, увидеть перспективы развития и новые конкурентные преимущества. Впервые для участников конкурса будет подготовлен маркетинговый отчет по результатам опроса посетителей выставок \rМебельного Форума\r.\rПрием заявок на участие в конкурсе осуществляется до 12 апреля 2010 года.','','МЕБЕЛЬНЫЙ ФОРУМ БЕЛАРУСИ\r\nС 20 ПО 23 АПРЕЛЯ 2010 ГОДА СОСТОИТСЯ \rМЕБЕЛЬНЫЙ ФОРУМ БЕЛАРУСИ\r ВАЖНЕЙШЕЕ МЕРОПРИЯТИИ ОТРАСЛИ В ТЕКУЩЕМ ГОДУ.\r\n\rС 20 ПО 23 АПРЕЛЯ 2010 ГОДА СОСТОИТСЯ \rМЕБЕЛЬНЫЙ ФОРУМ БЕЛАРУСИ\r ВАЖНЕЙШЕЕ МЕРОПРИЯТИИ ОТРАСЛИ В ТЕКУЩЕМ ГОДУ. В ЭКСПОЗИЦИИ ПРИНИМАЮТ УЧАСТИЕ СВЫШЕ 160 КОМПАНИЙ ИЗ \rБЕЛАРУСИ, АВСТРИИ, ЛАТВИИ, ЛИТВЫ, РОССИИ, ПОЛЬШИ \rИ\rУКРАИНЫ\r. В СОСТАВЕ ФОРУМА СОСТОИТСЯ ПЯТЬ ВЫСТАВОК:\"МИНСКИЙ МЕБЕЛЬНЫЙ САЛОН\", \"МЕБЕЛЬНЫЕ ТЕХНОЛОГИИ\", \"ОФИСКОМФОРТ\", \"КУХНЯ\" И \"ДОМОТЕХ\". ЭКСПОЗИЦИЯ БУДЕТ СТРОИТЬСЯ ПО ПРИНЦИПУ ДВУХ ТЕМАТИЧЕСКИХ СЕКТОРОВ:\rГОТОВОЙ МЕБЕЛИ\rИ \rМАТЕРИАЛОВ ДЛЯ ЕЕ ПРОИЗВОДСТВА\r.\rВ СЕКТОРЕ ГОТОВОЙ МЕБЕЛИ БУДУТ ПРЕДСТАВЛЕНЫ:\rКОРПУСНАЯ И МЯГКАЯ МЕБЕЛЬ;\rМЕБЕЛЬ ДЛЯ ДЕТЕЙ И МОЛОДЕЖИ;\rПРЕДМЕТЫ ИНТЕРЬЕРА;\rКУХОННАЯ МЕБЕЛЬ;\rМЕБЕЛЬ ДЛЯ ОФИСА И АДМИНИСТРАТИВНЫХ ЗДАНИЙ.\rВ СЕКТОРЕ МАТЕРИАЛОВ ДЛЯ ПРОИЗВОДСТВА МЕБЕЛИ БУДУТ ДЕМОНСТРИРОВАТЬСЯ НОВИНКИ РЫНКА МЕБЕЛЬНОЙ ФУРНИТУРЫ, МАТЕРИАЛОВ, ОБИВОЧНЫХ ТКАНЕЙ, ЭЛЕМЕНТОВ И АКСЕССУАРОВ ДЛЯ ПРОИЗВОДСТВА МЕБЕЛИ.\rПОМИМО РАСШИРЕННОЙ ЭКСПОЗИЦИИ ПЯТИ ТЕМАТИЧЕСКИХ ВЫСТАВОК \"ЭКСПОФОРУМ\" ПОДГОТОВИЛ РАЗНООБРАЗНУЮ ДЕЛОВУЮ ПРОГРАММУ МЕБЕЛЬНОГО ФОРУМА. В РАМКАХ ВЫСТАВКИ СОСТОЯТСЯ СЕМИНАРЫ И МАСТЕР-КЛАССЫ. И ПОИСТИНЕ МАСШТАБНЫМ В ЭТОМ ГОДУ ОБЕЩАЕТ СТАТЬ РЕСПУБЛИКАНСКИЙ КОНКУРС ФОРУМА \"\rНАРОДНОЕ ПРИЗНАНИЕ\r\". В ЭТОМ ГОДУ ОН ВЫХОДИТ ЗА РАМКИ ВЫСТАВКИ И СТАНОВИТСЯ РЕСПУБЛИКАНСКИМ СМОТРОМ ОБРАЗЦОВ МЕБЕЛИ.\rМЕБЕЛЬНЫЙ ФОРУМ\rПРЕДОСТАВЛЯЕТ СПЕЦИАЛИСТАМ ВОЗМОЖНОСТЬ ПОЗНАКОМИТЬСЯ С ТЕНДЕНЦИЯМИ МЕБЕЛЬНОЙ МОДЫ, ПРОВЕСТИ ПЕРЕГОВОРЫ, ПОЛУЧИТЬ ПРАКТИЧЕСКИЕ ПРЕДЛОЖЕНИЯ РЫНКА, УВИДЕТЬ ПЕРСПЕКТИВЫ РАЗВИТИЯ И НОВЫЕ КОНКУРЕНТНЫЕ ПРЕИМУЩЕСТВА. ВПЕРВЫЕ ДЛЯ УЧАСТНИКОВ КОНКУРСА БУДЕТ ПОДГОТОВЛЕН МАРКЕТИНГОВЫЙ ОТЧЕТ ПО РЕЗУЛЬТАТАМ ОПРОСА ПОСЕТИТЕЛЕЙ ВЫСТАВОК \rМЕБЕЛЬНОГО ФОРУМА\r.\rПРИЕМ ЗАЯВОК НА УЧАСТИЕ В КОНКУРСЕ ОСУЩЕСТВЛЯЕТСЯ ДО 12 АПРЕЛЯ 2010 ГОДА.\r\n','news','1',NULL,'2010-11-25 00:00:00',NULL),(23,'2010-11-26 00:00:00','iblock','2','s1',0,'=ID=2&EXTERNAL_ID=8&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=news&IBLOCK_ID=1&IBLOCK_CODE=furniture_news&IBLOCK_EXTERNAL_ID=furniture_news&CODE=salon_del_mobile','Международная мебельная выставка SALON DEL MOBILE','В 2010 году выставка Salon del Mobile обещает быть еще более расширенной и интересной. \r\nВ 2010 году выставка Salon del Mobile обещает быть еще более расширенной и интересной. На выставке Salon del Mobile будут представлены все типы мебели для офиса и дома от спален и гостиных до VIP-кабинетов, включая оборудование для сада и детской мебели. Заявки на участие подали более чем 1 500 компаний со всего мира. Предполагается, что за время проведения выставки ее посетят более 300 000 тысяч человек. Экспозиция выставки разместится на общей площади 149 871 кв.м. В 2010 году эта поистине грандиозная выставка будет проводиться уже в 10-й раз.','','МЕЖДУНАРОДНАЯ МЕБЕЛЬНАЯ ВЫСТАВКА SALON DEL MOBILE\r\nВ 2010 ГОДУ ВЫСТАВКА SALON DEL MOBILE ОБЕЩАЕТ БЫТЬ ЕЩЕ БОЛЕЕ РАСШИРЕННОЙ И ИНТЕРЕСНОЙ. \r\nВ 2010 ГОДУ ВЫСТАВКА SALON DEL MOBILE ОБЕЩАЕТ БЫТЬ ЕЩЕ БОЛЕЕ РАСШИРЕННОЙ И ИНТЕРЕСНОЙ. НА ВЫСТАВКЕ SALON DEL MOBILE БУДУТ ПРЕДСТАВЛЕНЫ ВСЕ ТИПЫ МЕБЕЛИ ДЛЯ ОФИСА И ДОМА ОТ СПАЛЕН И ГОСТИНЫХ ДО VIP-КАБИНЕТОВ, ВКЛЮЧАЯ ОБОРУДОВАНИЕ ДЛЯ САДА И ДЕТСКОЙ МЕБЕЛИ. ЗАЯВКИ НА УЧАСТИЕ ПОДАЛИ БОЛЕЕ ЧЕМ 1 500 КОМПАНИЙ СО ВСЕГО МИРА. ПРЕДПОЛАГАЕТСЯ, ЧТО ЗА ВРЕМЯ ПРОВЕДЕНИЯ ВЫСТАВКИ ЕЕ ПОСЕТЯТ БОЛЕЕ 300 000 ТЫСЯЧ ЧЕЛОВЕК. ЭКСПОЗИЦИЯ ВЫСТАВКИ РАЗМЕСТИТСЯ НА ОБЩЕЙ ПЛОЩАДИ 149 871 КВ.М. В 2010 ГОДУ ЭТА ПОИСТИНЕ ГРАНДИОЗНАЯ ВЫСТАВКА БУДЕТ ПРОВОДИТЬСЯ УЖЕ В 10-Й РАЗ.\r\n','news','1',NULL,'2010-11-26 00:00:00',NULL),(24,'2010-11-27 00:00:00','iblock','3','s1',0,'=ID=3&EXTERNAL_ID=9&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=news&IBLOCK_ID=1&IBLOCK_CODE=furniture_news&IBLOCK_EXTERNAL_ID=furniture_news&CODE=waterproof_connection','Получено прочное водостойкое соединение','Получено новое прочное водостойкое клеевое соединение.Изобретение относится к области получения и применения клеящих составов, используемых в деревообрабатывающей, мебельной и строительной промышленности. Данная клеевая композиция предназначена только для горячего прессования и имеет в своем составе многокомпонентный отвердитель. \r\n\rАвторы изобретения\r: Разиньков Егор Михайлович и Мещерякова Анна Анатольевна \rПатент Российской Федерации RU2277566\rОписание изобретения\rИзобретение относится к области получения и применения клеящих составов, используемых в деревообрабатывающей, мебельной и строительной промышленности.\rДанная клеевая композиция предназначена только для горячего прессования и имеет в своем составе многокомпонентный отвердитель. Прототипом клеевой композиции является клей, состоящий из карбамидоформальдегидной смолы, сополимера акрилонитрила с N-винилкапролактамом и отвердитель. В качестве отвердителя применяют хлористый аммоний либо акриловую кислоту. \rИзобретение решает задачу по получению прочного и водостойкого клеевого соединения.\rЭто достигается тем, что клеевая композиция, включающая синтетическую смолу и отвердитель, согласно изобретению, дополнительно содержит модификатор, причем в качестве синтетической смолы клеевая композиция включает карбамидомеламиноформальдегидную смолу с отвердителем 2542, в качестве модификатора - карбамидоформальдегидную смолу, а в качестве отвердителя - 10%-ный раствор щавелевой кислоты при следующем соотношении компонентов, мас.ч.:\rКарбамидомеламиноформальдегидная смола\r64,5-79,2\r10%-ный Раствор щавелевой кислоты\r4,4-20,5\rОтвердитель для карбамидомеламиноформальдегидной \r0,6-2,0\rсмолы 2542\r13,0-15,8','','ПОЛУЧЕНО ПРОЧНОЕ ВОДОСТОЙКОЕ СОЕДИНЕНИЕ\r\nПОЛУЧЕНО НОВОЕ ПРОЧНОЕ ВОДОСТОЙКОЕ КЛЕЕВОЕ СОЕДИНЕНИЕ.ИЗОБРЕТЕНИЕ ОТНОСИТСЯ К ОБЛАСТИ ПОЛУЧЕНИЯ И ПРИМЕНЕНИЯ КЛЕЯЩИХ СОСТАВОВ, ИСПОЛЬЗУЕМЫХ В ДЕРЕВООБРАБАТЫВАЮЩЕЙ, МЕБЕЛЬНОЙ И СТРОИТЕЛЬНОЙ ПРОМЫШЛЕННОСТИ. ДАННАЯ КЛЕЕВАЯ КОМПОЗИЦИЯ ПРЕДНАЗНАЧЕНА ТОЛЬКО ДЛЯ ГОРЯЧЕГО ПРЕССОВАНИЯ И ИМЕЕТ В СВОЕМ СОСТАВЕ МНОГОКОМПОНЕНТНЫЙ ОТВЕРДИТЕЛЬ. \r\n\rАВТОРЫ ИЗОБРЕТЕНИЯ\r: РАЗИНЬКОВ ЕГОР МИХАЙЛОВИЧ И МЕЩЕРЯКОВА АННА АНАТОЛЬЕВНА \rПАТЕНТ РОССИЙСКОЙ ФЕДЕРАЦИИ RU2277566\rОПИСАНИЕ ИЗОБРЕТЕНИЯ\rИЗОБРЕТЕНИЕ ОТНОСИТСЯ К ОБЛАСТИ ПОЛУЧЕНИЯ И ПРИМЕНЕНИЯ КЛЕЯЩИХ СОСТАВОВ, ИСПОЛЬЗУЕМЫХ В ДЕРЕВООБРАБАТЫВАЮЩЕЙ, МЕБЕЛЬНОЙ И СТРОИТЕЛЬНОЙ ПРОМЫШЛЕННОСТИ.\rДАННАЯ КЛЕЕВАЯ КОМПОЗИЦИЯ ПРЕДНАЗНАЧЕНА ТОЛЬКО ДЛЯ ГОРЯЧЕГО ПРЕССОВАНИЯ И ИМЕЕТ В СВОЕМ СОСТАВЕ МНОГОКОМПОНЕНТНЫЙ ОТВЕРДИТЕЛЬ. ПРОТОТИПОМ КЛЕЕВОЙ КОМПОЗИЦИИ ЯВЛЯЕТСЯ КЛЕЙ, СОСТОЯЩИЙ ИЗ КАРБАМИДОФОРМАЛЬДЕГИДНОЙ СМОЛЫ, СОПОЛИМЕРА АКРИЛОНИТРИЛА С N-ВИНИЛКАПРОЛАКТАМОМ И ОТВЕРДИТЕЛЬ. В КАЧЕСТВЕ ОТВЕРДИТЕЛЯ ПРИМЕНЯЮТ ХЛОРИСТЫЙ АММОНИЙ ЛИБО АКРИЛОВУЮ КИСЛОТУ. \rИЗОБРЕТЕНИЕ РЕШАЕТ ЗАДАЧУ ПО ПОЛУЧЕНИЮ ПРОЧНОГО И ВОДОСТОЙКОГО КЛЕЕВОГО СОЕДИНЕНИЯ.\rЭТО ДОСТИГАЕТСЯ ТЕМ, ЧТО КЛЕЕВАЯ КОМПОЗИЦИЯ, ВКЛЮЧАЮЩАЯ СИНТЕТИЧЕСКУЮ СМОЛУ И ОТВЕРДИТЕЛЬ, СОГЛАСНО ИЗОБРЕТЕНИЮ, ДОПОЛНИТЕЛЬНО СОДЕРЖИТ МОДИФИКАТОР, ПРИЧЕМ В КАЧЕСТВЕ СИНТЕТИЧЕСКОЙ СМОЛЫ КЛЕЕВАЯ КОМПОЗИЦИЯ ВКЛЮЧАЕТ КАРБАМИДОМЕЛАМИНОФОРМАЛЬДЕГИДНУЮ СМОЛУ С ОТВЕРДИТЕЛЕМ 2542, В КАЧЕСТВЕ МОДИФИКАТОРА - КАРБАМИДОФОРМАЛЬДЕГИДНУЮ СМОЛУ, А В КАЧЕСТВЕ ОТВЕРДИТЕЛЯ - 10%-НЫЙ РАСТВОР ЩАВЕЛЕВОЙ КИСЛОТЫ ПРИ СЛЕДУЮЩЕМ СООТНОШЕНИИ КОМПОНЕНТОВ, МАС.Ч.:\rКАРБАМИДОМЕЛАМИНОФОРМАЛЬДЕГИДНАЯ СМОЛА\r64,5-79,2\r10%-НЫЙ РАСТВОР ЩАВЕЛЕВОЙ КИСЛОТЫ\r4,4-20,5\rОТВЕРДИТЕЛЬ ДЛЯ КАРБАМИДОМЕЛАМИНОФОРМАЛЬДЕГИДНОЙ \r0,6-2,0\rСМОЛЫ 2542\r13,0-15,8\r\n','news','1',NULL,'2010-11-27 00:00:00',NULL),(25,'2011-05-26 18:18:27','iblock','S1','s1',0,'=ID=1&EXTERNAL_ID=12&IBLOCK_TYPE_ID=services&IBLOCK_ID=2&IBLOCK_CODE=faq&IBLOCK_EXTERNAL_ID=10&CODE=','Помощь покупателю','',NULL,'ПОМОЩЬ ПОКУПАТЕЛЮ\r\n\r\n','services','2',NULL,NULL,NULL),(26,'2011-05-26 18:18:27','iblock','4','s1',0,'=ID=4&EXTERNAL_ID=32&IBLOCK_SECTION_ID=1&IBLOCK_TYPE_ID=services&IBLOCK_ID=2&IBLOCK_CODE=faq&IBLOCK_EXTERNAL_ID=10&CODE=','Для чего нужна кнопка \"Повторить заказ\" в разделе \"Мои заказы\"?','С помощью этой кнопки клиент может поместить в корзину все товары из любого ранее оформленного заказа.','','ДЛЯ ЧЕГО НУЖНА КНОПКА \"ПОВТОРИТЬ ЗАКАЗ\" В РАЗДЕЛЕ \"МОИ ЗАКАЗЫ\"?\r\nС ПОМОЩЬЮ ЭТОЙ КНОПКИ КЛИЕНТ МОЖЕТ ПОМЕСТИТЬ В КОРЗИНУ ВСЕ ТОВАРЫ ИЗ ЛЮБОГО РАНЕЕ ОФОРМЛЕННОГО ЗАКАЗА.\r\n','services','2',NULL,NULL,NULL),(27,'2011-05-26 18:18:27','iblock','5','s1',0,'=ID=5&EXTERNAL_ID=33&IBLOCK_SECTION_ID=1&IBLOCK_TYPE_ID=services&IBLOCK_ID=2&IBLOCK_CODE=faq&IBLOCK_EXTERNAL_ID=10&CODE=','Как объединить два или несколько заказов в один?','Объединение нескольких заказов в один, к сожалению, технически невозможно.\rВ крайнем случае, можно аннулировать оформленные заказы и оформить новый с общим составом.','','КАК ОБЪЕДИНИТЬ ДВА ИЛИ НЕСКОЛЬКО ЗАКАЗОВ В ОДИН?\r\nОБЪЕДИНЕНИЕ НЕСКОЛЬКИХ ЗАКАЗОВ В ОДИН, К СОЖАЛЕНИЮ, ТЕХНИЧЕСКИ НЕВОЗМОЖНО.\rВ КРАЙНЕМ СЛУЧАЕ, МОЖНО АННУЛИРОВАТЬ ОФОРМЛЕННЫЕ ЗАКАЗЫ И ОФОРМИТЬ НОВЫЙ С ОБЩИМ СОСТАВОМ.\r\n','services','2',NULL,NULL,NULL),(28,'2011-05-26 18:18:27','iblock','6','s1',0,'=ID=6&EXTERNAL_ID=34&IBLOCK_SECTION_ID=1&IBLOCK_TYPE_ID=services&IBLOCK_ID=2&IBLOCK_CODE=faq&IBLOCK_EXTERNAL_ID=10&CODE=','Можно ли изменить адрес доставки оформленного заказа?','В оформленном заказе изменение адреса невозможно. \rВ крайнем случае, можно в личном кабинете выбрать заказ, для которого хотите изменить адрес, нажать ссылку \rПовторить заказ\rи указать другой адрес доставки, а старый заказ отменить.','','МОЖНО ЛИ ИЗМЕНИТЬ АДРЕС ДОСТАВКИ ОФОРМЛЕННОГО ЗАКАЗА?\r\nВ ОФОРМЛЕННОМ ЗАКАЗЕ ИЗМЕНЕНИЕ АДРЕСА НЕВОЗМОЖНО. \rВ КРАЙНЕМ СЛУЧАЕ, МОЖНО В ЛИЧНОМ КАБИНЕТЕ ВЫБРАТЬ ЗАКАЗ, ДЛЯ КОТОРОГО ХОТИТЕ ИЗМЕНИТЬ АДРЕС, НАЖАТЬ ССЫЛКУ \rПОВТОРИТЬ ЗАКАЗ\rИ УКАЗАТЬ ДРУГОЙ АДРЕС ДОСТАВКИ, А СТАРЫЙ ЗАКАЗ ОТМЕНИТЬ.\r\n','services','2',NULL,NULL,NULL),(29,'2011-05-26 18:18:27','iblock','7','s1',0,'=ID=7&EXTERNAL_ID=35&IBLOCK_SECTION_ID=1&IBLOCK_TYPE_ID=services&IBLOCK_ID=2&IBLOCK_CODE=faq&IBLOCK_EXTERNAL_ID=10&CODE=','Как аннулировать заказ или отдельный товар из заказа?','Чтобы аннулировать заказ или товар из заказа:\rЗайдите в раздел \rМои заказы\r;\rНайдите нужный заказ;\rНажмите на ссылку \rОтменить заказ\r.\rПримечание\r: отменить заказ можно только до того, как он оплачен.','','КАК АННУЛИРОВАТЬ ЗАКАЗ ИЛИ ОТДЕЛЬНЫЙ ТОВАР ИЗ ЗАКАЗА?\r\nЧТОБЫ АННУЛИРОВАТЬ ЗАКАЗ ИЛИ ТОВАР ИЗ ЗАКАЗА:\rЗАЙДИТЕ В РАЗДЕЛ \rМОИ ЗАКАЗЫ\r;\rНАЙДИТЕ НУЖНЫЙ ЗАКАЗ;\rНАЖМИТЕ НА ССЫЛКУ \rОТМЕНИТЬ ЗАКАЗ\r.\rПРИМЕЧАНИЕ\r: ОТМЕНИТЬ ЗАКАЗ МОЖНО ТОЛЬКО ДО ТОГО, КАК ОН ОПЛАЧЕН.\r\n','services','2',NULL,NULL,NULL),(30,'2011-05-26 18:18:27','iblock','8','s1',0,'=ID=8&EXTERNAL_ID=36&IBLOCK_SECTION_ID=1&IBLOCK_TYPE_ID=services&IBLOCK_ID=2&IBLOCK_CODE=faq&IBLOCK_EXTERNAL_ID=10&CODE=','Как узнать о состоянии заказа?','Покупатель может отследить состояние заказа непосредственно на сайте интернет-магазина в Персональном кабинете. Кроме этого он получает уведомления по электронной почте при оформлении заказа, его оплате и передаче заказа в службу доставки.\rВ случае возникновения вопросов клиент всегда может обратиться в службу по работе с клиентами по телефону и получить полную информацию о состоянии заказа.','','КАК УЗНАТЬ О СОСТОЯНИИ ЗАКАЗА?\r\nПОКУПАТЕЛЬ МОЖЕТ ОТСЛЕДИТЬ СОСТОЯНИЕ ЗАКАЗА НЕПОСРЕДСТВЕННО НА САЙТЕ ИНТЕРНЕТ-МАГАЗИНА В ПЕРСОНАЛЬНОМ КАБИНЕТЕ. КРОМЕ ЭТОГО ОН ПОЛУЧАЕТ УВЕДОМЛЕНИЯ ПО ЭЛЕКТРОННОЙ ПОЧТЕ ПРИ ОФОРМЛЕНИИ ЗАКАЗА, ЕГО ОПЛАТЕ И ПЕРЕДАЧЕ ЗАКАЗА В СЛУЖБУ ДОСТАВКИ.\rВ СЛУЧАЕ ВОЗНИКНОВЕНИЯ ВОПРОСОВ КЛИЕНТ ВСЕГДА МОЖЕТ ОБРАТИТЬСЯ В СЛУЖБУ ПО РАБОТЕ С КЛИЕНТАМИ ПО ТЕЛЕФОНУ И ПОЛУЧИТЬ ПОЛНУЮ ИНФОРМАЦИЮ О СОСТОЯНИИ ЗАКАЗА.\r\n','services','2',NULL,NULL,NULL),(31,'2011-05-26 18:18:27','iblock','9','s1',0,'=ID=9&EXTERNAL_ID=37&IBLOCK_SECTION_ID=1&IBLOCK_TYPE_ID=services&IBLOCK_ID=2&IBLOCK_CODE=faq&IBLOCK_EXTERNAL_ID=10&CODE=','Как возвратить товар или предъявить претензию?','Клиент вправе отказаться от заказанного товара надлежащего качества в любое время до его получения, а после получения - в течение 7 дней, не считая дня покупки. Возврат товара надлежащего качества возможен в случае, если сохранены его товарный вид, потребительские свойства, а также документ, подтверждающий факт и условия покупки указанного товара.\rЕсли покупатель отказывается от товара, то интернет-магазин возвращает ему стоимость возвращаемого товара, за исключением расходов продавца на доставку товара от клиента до интернет-магазина. \rКлиент может возвратить товар ненадлежащего качества изготовителю или продавцу и потребовать возврата уплаченной денежной суммы в течение гарантийного срока или срока годности. Клиент также вправе потребовать замены товара ненадлежащего качества либо устранения обнаруженных недостатков.\rВозврат средств в обоих случаях производится не позднее чем через 10 дней с даты получения продавцом письменного заявления клиента о возврате товара.','','КАК ВОЗВРАТИТЬ ТОВАР ИЛИ ПРЕДЪЯВИТЬ ПРЕТЕНЗИЮ?\r\nКЛИЕНТ ВПРАВЕ ОТКАЗАТЬСЯ ОТ ЗАКАЗАННОГО ТОВАРА НАДЛЕЖАЩЕГО КАЧЕСТВА В ЛЮБОЕ ВРЕМЯ ДО ЕГО ПОЛУЧЕНИЯ, А ПОСЛЕ ПОЛУЧЕНИЯ - В ТЕЧЕНИЕ 7 ДНЕЙ, НЕ СЧИТАЯ ДНЯ ПОКУПКИ. ВОЗВРАТ ТОВАРА НАДЛЕЖАЩЕГО КАЧЕСТВА ВОЗМОЖЕН В СЛУЧАЕ, ЕСЛИ СОХРАНЕНЫ ЕГО ТОВАРНЫЙ ВИД, ПОТРЕБИТЕЛЬСКИЕ СВОЙСТВА, А ТАКЖЕ ДОКУМЕНТ, ПОДТВЕРЖДАЮЩИЙ ФАКТ И УСЛОВИЯ ПОКУПКИ УКАЗАННОГО ТОВАРА.\rЕСЛИ ПОКУПАТЕЛЬ ОТКАЗЫВАЕТСЯ ОТ ТОВАРА, ТО ИНТЕРНЕТ-МАГАЗИН ВОЗВРАЩАЕТ ЕМУ СТОИМОСТЬ ВОЗВРАЩАЕМОГО ТОВАРА, ЗА ИСКЛЮЧЕНИЕМ РАСХОДОВ ПРОДАВЦА НА ДОСТАВКУ ТОВАРА ОТ КЛИЕНТА ДО ИНТЕРНЕТ-МАГАЗИНА. \rКЛИЕНТ МОЖЕТ ВОЗВРАТИТЬ ТОВАР НЕНАДЛЕЖАЩЕГО КАЧЕСТВА ИЗГОТОВИТЕЛЮ ИЛИ ПРОДАВЦУ И ПОТРЕБОВАТЬ ВОЗВРАТА УПЛАЧЕННОЙ ДЕНЕЖНОЙ СУММЫ В ТЕЧЕНИЕ ГАРАНТИЙНОГО СРОКА ИЛИ СРОКА ГОДНОСТИ. КЛИЕНТ ТАКЖЕ ВПРАВЕ ПОТРЕБОВАТЬ ЗАМЕНЫ ТОВАРА НЕНАДЛЕЖАЩЕГО КАЧЕСТВА ЛИБО УСТРАНЕНИЯ ОБНАРУЖЕННЫХ НЕДОСТАТКОВ.\rВОЗВРАТ СРЕДСТВ В ОБОИХ СЛУЧАЯХ ПРОИЗВОДИТСЯ НЕ ПОЗДНЕЕ ЧЕМ ЧЕРЕЗ 10 ДНЕЙ С ДАТЫ ПОЛУЧЕНИЯ ПРОДАВЦОМ ПИСЬМЕННОГО ЗАЯВЛЕНИЯ КЛИЕНТА О ВОЗВРАТЕ ТОВАРА.\r\n','services','2',NULL,NULL,NULL),(32,'2011-05-26 18:18:27','iblock','10','s1',0,'=ID=10&EXTERNAL_ID=38&IBLOCK_SECTION_ID=1&IBLOCK_TYPE_ID=services&IBLOCK_ID=2&IBLOCK_CODE=faq&IBLOCK_EXTERNAL_ID=10&CODE=','У меня есть купон на скидку. Как мне им воспользоваться?','Купон скидок позволяет получить персональную скидку на товар. Для этого при оформлении заказа в разделе \rМоя корзина\rукажите код купона скидки в специальном поле.','','У МЕНЯ ЕСТЬ КУПОН НА СКИДКУ. КАК МНЕ ИМ ВОСПОЛЬЗОВАТЬСЯ?\r\nКУПОН СКИДОК ПОЗВОЛЯЕТ ПОЛУЧИТЬ ПЕРСОНАЛЬНУЮ СКИДКУ НА ТОВАР. ДЛЯ ЭТОГО ПРИ ОФОРМЛЕНИИ ЗАКАЗА В РАЗДЕЛЕ \rМОЯ КОРЗИНА\rУКАЖИТЕ КОД КУПОНА СКИДКИ В СПЕЦИАЛЬНОМ ПОЛЕ.\r\n','services','2',NULL,NULL,NULL),(9159,'2012-08-08 08:01:09','iblock','4245','s1',0,'=ID=4245&EXTERNAL_ID=UT000000276&IBLOCK_SECTION_ID=110&IBLOCK_TYPE_ID=catalog&IBLOCK_ID=6&IBLOCK_CODE=outdoor&IBLOCK_EXTERNAL_ID=&CODE=UT000000276','Щит 3*6 ул.Харьковская, 57 ресторан Александр, сторона А','139А\r\nХарьковская, 57 ресторан Александр. Билборд установлен на ул.Харьковская, в 250м. от перекрестка с ул.Холодильная, в районе жилой застройки, рядом с элитным рестораном Александр. Ст. А работает в направлении движения от ул.Мельникайте к ул.Холодильная.\r\nРазмещение рекламной информации на щите 3*6 по адресу ул.Харьковская, 57 ресторан Александр, сторона А, инв.139А\r\nООО Тюменьстройбыт\r\n1\r\n2\r\nЦентр\r\nХарьковская\r\n3*6\r\nA\r\nТОП\r\n\rThe access key is not s